(936, 1, 'Casino Royale', 'tt0381061', '36557', 1, '', 'Hollywood', '2006', 'Le Chiffre, a banker to the world\'s terrorists, is scheduled to participate in a high-stakes poker game in Montenegro, where he intends to use his winnings to establish his financial grip on the terrorist market. M sends Bond—on his maiden mission as a 00 Agent—to attend this game and prevent Le Chiffre from winning. With the help of Vesper Lynd and Felix Leiter, Bond enters the most important poker game in his already dangerous career.', 'Adventure', 'Action', 'Thriller', 'U4NT78c-pYs', '/lMrxYKKhd4lqRzwUHAy5gcx9PSO.jpg', 1, ' ', '/8LzIoiJyvL26VTD8nWPderGPmBS.jpg', '/kjC48HRQpojr3FHx5pZF7Ro9xFg.jpg', '144', 7.547),
(937, 1, 'Poor Things', 'tt14230458', '792307', 1, '', 'Hollywood', '2023', 'Brought back to life by an unorthodox scientist, a young woman runs off with a lawyer on a whirlwind adventure across the continents. Free from the prejudices of her times, she grows steadfast in her purpose to stand for equality and liberation.', 'Science Fiction', 'Romance', 'Comedy', 'Rt1eClGhLMg', '/kCGlIMHnOm8JPXq3rXM6c5wMxcT.jpg', 1, ' ', '/gsVC7HMf4VR2XFOyqjTSklY2Tms.jpg', '/gsVC7HMf4VR2XFOyqjTSklY2Tms.jpg', '141', 0),
