(941, 1, 'Se7en', 'tt0114369', '807', 1, '', 'Hollywood', '1995', 'Two homicide detectives are on a desperate hunt for a serial killer whose crimes are based on the \"seven deadly sins\" in this dark and haunting film that takes viewers from the tortured remains of one victim to the next. The seasoned Det. Sommerset researches each sin in an effort to get inside the killer\'s mind, while his novice partner, Mills, scoffs at his efforts to unravel the case.', 'Crime', 'Mystery', 'Thriller', 'BJKukbTDLto', '/6yoghtyTpznpBik8EngEmJskVUO.jpg', 1, ' ', '/6jRk8m3Bd5i514cFzv95YKUjpw8.jpg', '/dYjZ27hDw2QFaEIfzbNGwW0IkV9.jpg', '127', 8.371),
