(943, 1, 'Blade Runner 2049', 'tt1856101', '335984', 1, '', 'Hollywood', '2017', 'Thirty years after the events of the first film, a new blade runner, LAPD Officer K, unearths a long-buried secret that has the potential to plunge what\'s left of society into chaos. K\'s discovery leads him on a quest to find Rick Deckard, a former LAPD blade runner who has been missing for 30 years.', 'Science Fiction', 'Drama', '', 'geFtxCSz8xI', '/gajva2L0rPYkEWjzgFlBXCAVBE5.jpg', 1, ' ', '/zdhCwSOHkvyRqOwXv0g3TVEOCKU.jpg', '/ilRyazdMJwN05exqhwK4tMKBYZs.jpg', '164', 7.5),
