(960, 1, 'Reptile', 'tt13274016', '866463', 1, '', 'Hollywood', '2023', 'Following the brutal murder of a young real estate agent, a hardened detective attempts to uncover the truth in a case where nothing is as it seems, and by doing so dismantles the illusions in his own life.', 'Thriller', 'Crime', 'Drama', '5LZ5RbwEJ98', '/soIgqZBoTiTgMqUW0JtxsPWAilQ.jpg', 1, ' ', '/2Qb59ePheX8PZ5cHUQaY2voe0E3.jpg', '/nrp2khEM6JWFqqNLeub1J6Qafe0.jpg', '136', 6.883),
(961, 1, 'Love, Rosie', 'tt1638002', '200727', 1, '', 'Hollywood', '2014', 'Since the moment they met at age 5, Rosie and Alex have been best friends, facing the highs and lows of growing up side by side. A fleeting shared moment, one missed opportunity, and the decisions that follow send their lives in completely different directions. As each navigates the complexities of life, love, and everything in between, they always find their way back to each other - but is it just friendship, or something more?', 'Romance', 'Drama', 'Comedy', 'dOMTh9Jd81w', '/rpD0t7DhzJVadnzgxSYrqljQTL2.jpg', 1, ' ', '/rsYdHBaWwodnB6hMu0F8E7aCpfL.jpg', '/txDX7lBx8bBhF7dRCEfDYmAmdnk.jpg', '102', 7.838),
(962, 1, 'Crazy, Stupid, Love.', 'tt1570728', '50646', 1, '', 'Hollywood', '2011', 'Cal Weaver is living the American dream. He has a good job, a beautiful house, great children and a beautiful wife, named Emily. Cal\'s seemingly perfect life unravels, however, when he learns that Emily has been unfaithful and wants a divorce. Over 40 and suddenly single, Cal is adrift in the fickle world of dating. Enter, Jacob Palmer, a self-styled player who takes Cal under his wing and teaches him how to be a hit with the ladies.', 'Comedy', 'Drama', 'Romance', 'vGRXOooHCAA', '/p4RafgAPk558muOjnBMHhMArjS2.jpg', 1, ' ', '/1YnjJKjgDjTkLmv4Qds3vWsOq6D.jpg', '/vTwNAu8C4SkYvPp73rFAmLvXVym.jpg', '118', 7.26),
(963, 1, 'Secret Obsession', 'tt9419834', '612152', 1, '', 'Hollywood', '2019', 'Newlywed Jennifer is brutally attacked at a dark rest stop. While healing from her injuries, she can’t recall anything from her past, including the ordeal. Her husband, Russell , is just thankful she’s alive and eager to get her home. As he reintroduces her to their secluded mountain estate, Detective Page  pursues Jennifer’s assailant — his own daughter went missing and was never found. The same fate now awaits Jennifer, unless someone realizes that her loving caretaker is actually her captor.', 'Drama', 'Thriller', '', 'Nc6loZU3kjQ', '/iKMeE6oYzBVzhA6xLGb8PPWEruF.jpg', 1, ' ', '/sQdLlRXDrXFzfbnKqEgLCCkyssR.jpg', '/vLs4SePN91EcfjcUsQJSfW2rePm.jpg', '97', 5.5),
(964, 1, 'Atonement', 'tt0783233', '4347', 1, '', 'Hollywood', '2007', 'As a 13-year-old, fledgling writer Briony Tallis irrevocably changes the course of several lives when she accuses her older sister\'s lover of a crime he did not commit.', 'Drama', 'Romance', '', 'XJBEq80ubXg', '/hMRIyBjPzxaSXWM06se3OcNjIQa.jpg', 1, ' ', '/dM6qZCC4X0oAp83HmTbM640xeL6.jpg', '/sCDWoyRutBPVHzVGB2nmXE8oxaX.jpg', '123', 7.7),
(965, 1, 'Titanic', 'tt0120338', '597', 1, '', 'Hollywood', '1997', '101-year-old Rose DeWitt Bukater tells the story of her life aboard the Titanic, 84 years later. A young Rose boards the ship with her mother and fiancé. Meanwhile, Jack Dawson and Fabrizio De Rossi win third-class tickets aboard the ship. Rose tells the whole story from Titanic\'s departure through to its death—on its first and last voyage—on April 15, 1912.', 'Drama', 'Romance', '', 'UFQ2AZVQ9mg', '/9xjZS2rlVxm8SFx8kPC3aIGCOYQ.jpg', 1, ' ', '/tBEp5F0tUM105IdBTOmyJB5LZgG.jpg', '/rzdPqYx7Um4FUZeD8wpXqjAUcEm.jpg', '194', 7.9),
(966, 1, 'The Boy in the Striped Pyjamas', 'tt0914798', '14574', 1, '', 'Hollywood', '2008', 'When his family moves from their home in Berlin to a strange new house in Poland, young Bruno befriends Shmuel, a boy who lives on the other side of the fence where everyone seems to be wearing striped pajamas. Unaware of Shmuel\'s fate as a Jewish prisoner or the role his own Nazi father plays in his imprisonment, Bruno embarks on a dangerous journey inside the camp\'s walls.', 'Drama', 'War', 'History', 'uwysOfnX2Qg', '/sLwYSEVVV3r047cjrpRAbGgNsfL.jpg', 1, ' ', '/fZBmxa6gF7r9t7ZgKHGVkbeEx4l.jpg', '/7fJAYM0rhzpEhCK6wxbQ412EoYW.jpg', '94', 7.852),
(967, 1, 'Forrest Gump', 'tt0109830', '13', 1, '', 'Hollywood', '1994', 'A man with a low IQ has accomplished great things in his life and been present during significant historic events—in each case, far exceeding what anyone imagined he could do. But despite all he has achieved, his one true love eludes him.', 'Comedy', 'Drama', 'Romance', '0YAKkHutmFI', '/arw2vcBveWOVZr6pxd9XTd1TdQa.jpg', 1, ' ', '/vwkDy2wDm2aglYDprOSuVgT5J1L.jpg', '/qdIMHd4sEfJSckfVJfKQvisL02a.jpg', '142', 8.476),
(968, 1, 'The Pianist', 'tt0253474', '423', 1, '', 'Hollywood', '2002', 'The true story of pianist Władysław Szpilman\'s experiences in Warsaw during the Nazi occupation. When the Jews of the city find themselves forced into a ghetto, Szpilman finds work playing in a café; and when his family is deported in 1942, he stays behind, works for a while as a laborer, and eventually goes into hiding in the ruins of the war-torn city.', 'Drama', 'War', '', 'BFwGqLa_oAo', '/2hFvxCCWrTmCYwfy7yum0GKRi3Y.jpg', 1, ' ', '/hg84hWpEQFjXMsoIPgskFFAtE2e.jpg', '/dVr11o9or7AS8AMPfwjSpEU83iU.jpg', '150', 8.383),
(969, 1, 'Valerian and the City of a Thousand Planets', 'tt2239822', '339964', 1, '', 'Hollywood', '2017', 'In the 28th century, Valerian and Laureline are special operatives charged with keeping order throughout the human territories. On assignment from the Minister of Defense, the two undertake a mission to Alpha, an ever-expanding metropolis where species from across the universe have converged over centuries to share knowledge, intelligence, and cultures. At the center of Alpha is a mysterious dark force which threatens the peaceful existence of the City of a Thousand Planets, and Valerian and Laureline must race to identify the menace and safeguard not just Alpha, but the future of the universe.', 'Adventure', 'Science Fiction', 'Action', 'BASgoRz72R0', '/aCDrPEfvxcPNRynd2uZyXql7aj.jpg', 1, ' ', '/seCgrKkpTnAfM5iUTi2EThan90c.jpg', '/5rYnygKCkmqWuMv1O5yAnzGF8gV.jpg', '136', 6.63),
(970, 1, 'Mortal Engines', 'tt1571234', '428078', 1, 'PG-13', 'Hollywood', '2018', 'Many thousands of years in the future, Earth’s cities roam the globe on huge wheels, devouring each other in a struggle for ever diminishing resources. On one of these massive traction cities, the old London, Tom Natsworthy has an unexpected encounter with a mysterious young woman from the wastelands who will change the course of his life forever.', 'Adventure', 'Science Fiction', '', 'Shq9J3My9zw', '/gLhYg9NIvIPKVRTtvzCWnp1qJWG.jpg', 1, ' ', '/dbZNEoUNgrhxco8yBaQqPXKNzo9.jpg', '/rm2oMykm5nX6SzXFr7TGHkO6r8Z.jpg', '129', 6.2),
(971, 1, 'The Perks of Being a Wallflower', 'tt1659337', '84892', 1, '', 'Hollywood', '2012', 'Pittsburgh, Pennsylvania, 1991. High school freshman Charlie is a wallflower, always watching life from the sidelines, until two senior students, Sam and her stepbrother Patrick, become his mentors, helping him discover the joys of friendship, music and love.', 'Drama', '', '', 'QE7CGX1d6LU', '/aKCvdFFF5n80P2VdS7d8YBwbCjh.jpg', 1, ' ', '/rP7yVVy5qUc6mzqnbvvskmR4OvN.jpg', '/qb6WoLJ9YtfhV7pgsTfUDlRYaCH.jpg', '103', 7.788),
(972, 1, 'Mr. & Mrs. Smith', 'tt0356910', '787', 1, '', 'Hollywood', '2005', 'After five (or six) years of vanilla-wedded bliss, ordinary suburbanites John and Jane Smith are stuck in a huge rut. Unbeknownst to each other, they are both coolly lethal, highly-paid assassins working for rival organisations. When they discover they\'re each other\'s next target, their secret lives collide in a spicy, explosive mix of wicked comedy, pent-up passion, nonstop action and high-tech weaponry.', 'Action', 'Comedy', 'Drama', 'TWB_icm5M38', '/wzIO3ytxeSNt1wRpXLIdkNbGoDm.jpg', 1, ' ', '/gaZK3jT9sSsLfT479nGVXWxN0Hz.jpg', '/iFaWUETEE2umP1WY0LUAmjSpzm7.jpg', '119', 6.677),
(973, 1, 'Acrimony', 'tt6063050', '464502', 1, '', 'Hollywood', '2018', 'Faithful wife Melinda, who is tired of standing by her devious husband Robert, is enraged when it becomes clear she has been betrayed. That\'s when she lost it, and now she cannot let it go.', 'Drama', 'Thriller', '', 'wlpunOUxYSo', '/upURIW6jeEcTJKpaJeoNw5jbcr1.jpg', 1, ' ', '/myci0NYhVdsm6n4Q9rsopwrqQFK.jpg', '/h9USMzm43BZyUXc45OZAPlPBUjZ.jpg', '120', 6.7),
(974, 1, 'Little Women', 'tt6495094', '483347', 1, '', 'Hollywood', '2018', 'A modern retelling of Louisa May Alcott\'s classic novel, we follow the lives of four sisters - Meg, Jo, Beth, and Amy March - detailing their passage from childhood to womanhood. Despite harsh times, they cling to optimism, and as they mature, they face blossoming ambitions and relationships, as well as tragedy, while maintaining their unbreakable bond as sisters.', 'Drama', '', '', 'U7yNDrTgwBY', '/3q5kEdiT0nRKVtm6eFBhD4nP3wq.jpg', 1, ' ', '/dsmzFuJsTjkl4YOJw7ogmkAQBUJ.jpg', '/xKUYPnJheAO8ynrOTLbQesg1IVt.jpg', '112', 6.4),
(975, 1, 'The Fault in Our Stars', 'tt2582846', '222935', 1, '', 'Hollywood', '2014', 'Despite the tumor-shrinking medical miracle that has bought her a few years, Hazel has never been anything but terminal, her final chapter inscribed upon diagnosis. But when a patient named Augustus Waters suddenly appears at Cancer Kid Support Group, Hazel\'s story is about to be completely rewritten.', 'Romance', 'Drama', '', '3Ixw15DE-xY', '/ep7dF4QR4Mm39LI958V0XbwE0hK.jpg', 1, ' ', '/jbrExTJXi07ypzwJiJNoZiGl6q3.jpg', '/oQaVV7p916HO5MDI820zzs1pin9.jpg', '126', 7.598),
(976, 1, 'Five Feet Apart', 'tt6472976', '527641', 1, '', 'Hollywood', '2019', 'Seventeen-year-old Stella spends most of her time in the hospital as a cystic fibrosis patient. Her life is full of routines, boundaries and self-control — all of which get put to the test when she meets Will, an impossibly charming teen who has the same illness. There\'s an instant flirtation, though restrictions dictate that they must maintain a safe distance between them. As their connection intensifies, so does the temptation to throw the rules out the window and embrace that attraction.', 'Romance', 'Drama', '', '24YrEAGF32M', '/kreTuJBkUjVWePRfhHZuYfhNE1T.jpg', 1, ' ', '/ia3jr9klkOYO6cIwOmpnI5mohcy.jpg', '/27ZkYMWynuK2qiDP6awc3MsCaOs.jpg', '116', 8.283),
(977, 1, 'Black Swan', 'tt0947798', '44214', 1, '', 'Hollywood', '2010', 'A journey through the psyche of a young ballerina whose starring role as the duplicitous swan queen turns out to be a part for which she becomes frighteningly perfect.', 'Drama', 'Thriller', 'Horror', 'YCg0TXqvz0Q', '/rH19vkjAzCZ0HIUvrgB3rowm68h.jpg', 1, ' ', '/oIRLkAS5kz1HpLuxoVIcRrarhoo.jpg', '/qxTw8OKJLRX1Xb5nR5CcIDnLKoq.jpg', '108', 7.677),
(978, 1, 'Anna Karenina', 'tt1781769', '96724', 1, 'R', 'Hollywood', '2012', 'In Imperial Russia, Anna, the wife of the officer Karenin, goes to Moscow to visit her brother. On the way, she meets the charming cavalry officer Vronsky to whom she is immediately attracted. But in St. Petersburg’s high society, a relationship like this could destroy a woman’s reputation.', 'Drama', 'Romance', 'History', 'ombvHSxmfiI', '/1Obj9mNcWxqnmnnxGn1dtZuHgtp.jpg', 1, ' ', '/7UYA7ijE8vHybgvbBuAw8Cc2Dlu.jpg', '/54L28AmXoZ5ngjZte8Pcht2fDyR.jpg', '130', 6.7),
