(981, 1, '22 July', 'tt7280898', '474354', 1, '', 'Hollywood', '2018', 'On 22 July 2011, neo-Nazi terrorist Anders Behring Breivik murdered 77 young people attending a Labour Party Youth Camp on Utøya Island outside of Oslo. This three-part story focuses on the survivors, the political leadership of Norway, and the lawyers involved.', 'History', 'Drama', 'Thriller', 'ZVpUZGmHJB8', '/rd940KzuIZwbdOvOUF7XDTzn8te.jpg', 1, ' ', '/iChucu69wC4ccXwGii4PuCT7MnY.jpg', '/rKzHtW1bdboA89FwiyRBNTY7edc.jpg', '143', 7.092),
