(983, 1, '22 Jump Street', 'tt2294449', '187017', 1, '', 'Hollywood', '2014', 'After making their way through high school (twice), big changes are in store for officers Schmidt and Jenko when they go deep undercover at a local college. But when Jenko meets a kindred spirit on the football team, and Schmidt infiltrates the bohemian art major scene, they begin to question their partnership. Now they don\'t have to just crack the case - they have to figure out if they can have a mature relationship. If these two overgrown adolescents can grow from freshmen into real men, college might be the best thing that ever happened to them.', 'Crime', 'Comedy', 'Action', '8VXj3Q0e608', '/850chzYHYbT3IISl6Q7dbBuFP2B.jpg', 1, ' ', '/26MQRYMJbqfx69dmzlEtrW94aVS.jpg', '/kdyYOwpKvvD2fSbwfnMM2YPAzfq.jpg', '112', 6.8),
(984, 1, 'Miracles from Heaven', 'tt4257926', '339984', 1, '', 'Hollywood', '2016', 'When Christy discovers her 10-year-old daughter Anna has a rare, incurable disease, she becomes a ferocious advocate for her daughter’s healing as she searches for a solution. After Anna has a freak accident and falls three stories, a miracle unfolds in the wake of her dramatic rescue that leaves medical specialists mystified, her family restored and their community inspired.', 'Family', 'Drama', 'Fantasy', 'rfatdnwzsE0', '/hz9VF1TfaM0D04pYneSXUkNeOZv.jpg', 1, ' ', '/eSs0CkWB5ASQgcx8Dr0uai3IRjT.jpg', '/wePpxpU1eNZnHCChP5xGNJrGKY3.jpg', '119', 7.426),
