(986, 1, 'Call Me by Your Name', 'tt5726616', '398818', 1, '', 'Hollywood', '2017', 'In 1980s Italy, a relationship begins between seventeen-year-old teenage Elio and the older adult man hired as his father\'s research assistant.', 'Romance', 'Drama', '', '_IBft4jvWZ0', '/mZ4gBdfkhP9tvLH1DO4m4HYtiyi.jpg', 1, ' ', '/yF3tTgu5O9r4rFvpUQ4RzWkATB2.jpg', '/zvOJawrnmgK0sL293mOXOdLvTXQ.jpg', '132', 8.164),
