(988, 1, 'Nick and Norah\'s Infinite Playlist', 'tt0981227', '12182', 1, '', 'Hollywood', '2008', 'Nick cannot stop obsessing over his ex-girlfriend, Tris, until Tris\' friend Norah suddenly shows interest in him at a club. Thus begins an odd night filled with ups and downs as the two keep running into Tris and her new boyfriend while searching for Norah\'s drunken friend, Caroline, with help from Nick\'s band mates. As the night winds down, the two have to figure out what they want from each other.', 'Comedy', 'Music', 'Drama', '0yYcfsYZaWU', '/cndxWgZEHnSUtytrMjal97ye34E.jpg', 1, ' ', '/wuTrB8qHAmkpMSboFXjO8Uk88GA.jpg', '/vYtVIUKpGK3cCvH939cfUu9eIDj.jpg', '89', 6.5),
