(997, 1, 'Consecration', 'tt14993352', '884184', 1, '', 'Hollywood', '2023', 'After the alleged suicide of her priest brother, Grace travels to the remote Scottish convent where he fell to his death. Distrusting the Church\'s account, she uncovers murder, sacrilege and a disturbing truth about herself.', 'Horror', 'Thriller', '', 'HRjG65M6L2c', '/yQTRmPzKAdLodknnPVtImm6FWPZ.jpg', 1, ' ', '/5Pd4I4pISARWvlH3h6KV2pOZoPL.jpg', '/sRfX2XPjyL7nRKVRKXVG6D0bVQI.jpg', '90', 5.8),
(998, 1, 'Pride & Prejudice', 'tt0414387', '4348', 1, '', 'Hollywood', '2005', 'A story of love and life among the landed English gentry during the Georgian era. Mr. Bennet is a gentleman living in Hertfordshire with his overbearing wife and five daughters, but if he dies their house will be inherited by a distant cousin whom they have never met, so the family\'s future happiness and security is dependent on the daughters making good marriages.', 'Drama', 'Romance', '', '5iWpKnjWWIE', '/sGjIvtVvTlWnia2zfJfHz81pZ9Q.jpg', 1, ' ', '/AgJFfkbGMYwt8PCOP75S8ReKYQp.jpg', '/pgEWI7yGYF0mM5Uf1YxSOHsBkJR.jpg', '127', 8.086),
(999, 1, 'Where the Crawdads Sing', 'tt9411972', '682507', 1, '', 'Hollywood', '2022', 'Abandoned by her family, Kya raises herself all alone in the marshes outside of her small town. When her former boyfriend is found dead, Kya is instantly branded by the local townspeople and law enforcement as the prime suspect for his murder.', 'Drama', 'Mystery', 'Romance', '7qgQ_caLKrk', '/6h5OCqRnWH7Dcm4IeP4JypBdtuI.jpg', 1, ' ', '/dgozTZk3dIBSktdwbjSJEnMQHEg.jpg', '/4js6A53tpvUbCEcUsKwuetRnVGb.jpg', '126', 7.555),
(1000, 1, 'Love & Other Drugs', 'tt0758752', '43347', 1, '', 'Hollywood', '2010', 'Maggie is an alluring free spirit who won\'t let anyone – or anything – tie her down. But she meets her match in Jamie, whose relentless and nearly infallible charm serves him well with the ladies and the cutthroat world of pharmaceutical sales. Maggie and Jamie\'s evolving relationship takes them both by surprise, as they find themselves under the influence of the ultimate drug: love.', 'Drama', 'Comedy', 'Romance', 'h6w7Dh-QxzY', '/wZLM2uKJRYNchLmiCIjosX0rXy8.jpg', 1, ' ', '/gZy7WQgzLU4B08eJM1aLci3F0oo.jpg', '/mcSQa6hyBY3kLj0Eaey2K1Ev852.jpg', '112', 7.043),
(1001, 1, 'The Dark Knight', 'tt0468569', '155', 1, '', 'Hollywood', '2008', 'Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.', 'Drama', 'Action', 'Crime', 'QEBCT-Lsh-A', '/qJ2tW6WMUDux911r6m7haRef0WH.jpg', 1, ' ', '/A9YICp8lGP7Es5R8oD6qUbvDWhn.jpg', '/nMKdUUepR0i5zn0y1T4CsSB5chy.jpg', '152', 8.5),
(1002, 1, 'Pearl', 'tt18925334', '949423', 1, '', 'Hollywood', '2022', 'Trapped on her family’s isolated farm, Pearl must tend to her ailing father under the bitter and overbearing watch of her devout mother. Lusting for a glamorous life like she’s seen in the movies, Pearl’s ambitions, temptations, and repressions collide.', 'Horror', 'Drama', 'Thriller', 'Anug-FcTOc4', '/ulBLIBqvdnf4H6JBt0OpMCU1ECn.jpg', 1, ' ', '/emkv77oQDt3iehg6n6QdJqUTSUl.jpg', '/8rmx3Wh6fQdSL2nzTmdFn9thcK8.jpg', '102', 7.321),
(1003, 1, 'Fast Charlie', 'tt6722400', '945937', 1, '', 'Hollywood', '2023', 'When his aging mob boss is whacked, Charlie Swift, a loyal friend and hired gun, will stop at nothing to destroy the upcoming crew that took him out.', 'Action', 'Crime', 'Drama', 'yWwUYdtCviI', '/3y72ffwYRUPOj4yOQbiTaN897Tm.jpg', 1, ' ', '/nTajLiBmxvajfiU3lX4Y4V9wxTm.jpg', '/kG8iWrKGNlrUM7LfT6zJEOXglZd.jpg', '90', 6.125),
(1004, 1, 'Leave the World Behind', 'tt12747748', '726209', 1, '', 'Hollywood', '2023', 'A family\'s getaway to a luxurious rental home takes an ominous turn when a cyberattack knocks out their devices — and two strangers appear at their door.', 'Drama', 'Mystery', 'Thriller', 'xM4ILvKeTxs', '/l2bqoY9rgPAgugPkOTowIPIv61j.jpg', 1, ' ', '/lKRnYVfIaOXHYoyRubq3XJcaqD6.jpg', '/z6OkT7XjzSrgstiTlld0jUvME9y.jpg', '141', 6.757),
(1005, 1, 'Rise', 'tt11242162', '759054', 1, '', 'Hollywood', '2022', 'After emigrating to Greece from Nigeria, Vera and Charles Antetokounmpo struggled to survive and provide for their five children, while living under the daily threat of deportation. Desperate to obtain Greek citizenship but undermined by a system that blocked them at every turn, the family\'s vision, determination and faith lifted them out of obscurity to launch the careers of three NBA champions.', 'Drama', '', '', 'numzJtJWT8c', '/p6FMYJSc9vhyqzMaYOC8yPS7aXQ.jpg', 1, ' ', '/z001cjS2AT4PuYksgxCjeIjQDwF.jpg', '/uKL39lSf3rQbcMG8XbByoHBwGId.jpg', '113', 7.6),
(1006, 1, 'The Hunger Games: The Ballad of Songbirds & Snakes', 'tt10545296', '695721', 1, '', 'Hollywood', '2023', '64 years before he becomes the tyrannical president of Panem, Coriolanus Snow sees a chance for a change in fortunes when he mentors Lucy Gray Baird, the female tribute from District 12.', 'Action', 'Romance', 'Drama', 'y2nBqLXcg1s', '/mBaXZ95R2OxueZhvQbcEWy2DqyO.jpg', 1, ' ', '/hLKae6nMPO72G5PNCyzJPCSL5BV.jpg', '/8GnWDLn2AhnmkQ7hlQ9NJUYobSS.jpg', '157', 7.3),
(1009, 1, 'The Words', 'tt1840417', '83686', 1, '', 'Hollywood', '2012', 'The Words follows young writer Rory Jansen who finally achieves long sought after literary success after publishing the next great American novel. There\'s only one catch - he didn\'t write it. As the past comes back to haunt him and his literary star continues to rise, Jansen is forced to confront the steep price that must be paid for stealing another man\'s work, and for placing ambition and success above life\'s most fundamental three words.', 'Drama', 'Thriller', '', 'lTlh70mx-eM', '/aJtPLZS7tlpiQl6pEr8H42K565x.jpg', 1, ' ', '/pbeviFppOf8DimSX8zSzCfoCeLg.jpg', '/b0GGZbLB7P9r4klx1wUcz77WzE6.jpg', '96', 6.7),
(1010, 1, 'The Autopsy of Jane Doe', 'tt3289956', '397243', 1, '', 'Hollywood', '2016', 'Father and son coroners receive a mysterious unidentified corpse with no apparent cause of death. As they attempt to examine the \"Jane Doe,\" they discover increasingly bizarre clues that hold the key to her terrifying secrets.', 'Horror', 'Mystery', '', 'BNxsaFCzqxc', '/6K0wjP8kPCiPYy9PtXBGuypyt5I.jpg', 1, ' ', '/qhKZkMAvfkVzPp989TnwYdhbYU1.jpg', '/7GEi50BH2gjWuhoAx55Mmb0f7Vj.jpg', '86', 6.756),
(1011, 1, 'The Tree of Life', 'tt0478304', '8967', 1, '', 'Hollywood', '2011', 'The impressionistic story of a Texas family in the 1950s. The film follows the life journey of the eldest son, Jack, through the innocence of childhood to his disillusioned adult years as he tries to reconcile a complicated relationship with his father. Jack finds himself a lost soul in the modern world, seeking answers to the origins and meaning of life while questioning the existence of faith.', 'Drama', 'Fantasy', '', 'RrAz1YLh8nY', '/l8cwuB5WJSoj4uMAsnzuHBOMaSJ.jpg', 1, ' ', '/asoFDnt36s0a5QifGyaN0iP5uhh.jpg', '/krDjqWqLAewVYiU8fDQLHO7gPmf.jpg', '139', 6.73),
(1012, 1, 'Portrait of a Lady on Fire', 'tt8613070', '531428', 1, '', 'Hollywood', '2019', 'On an isolated island in Brittany at the end of the eighteenth century, a female painter is obliged to paint a wedding portrait of a young woman.', 'Drama', 'Romance', '', 'R-fQPTwma9o', '/2LquGwEhbg3soxSCs9VNyh5VJd9.jpg', 1, ' ', '/h8kXLI8mjfHbtZw4JAKlFPkFPyK.jpg', '/foFq1RZWQIgFuCQ0nyYccywjFyX.jpg', '120', 8.167),
(1013, 1, 'The Master', 'tt1560747', '68722', 1, '', 'Hollywood', '2012', 'Freddie, a volatile, heavy-drinking veteran who suffers from post-traumatic stress disorder, finds some semblance of a family when he stumbles onto the ship of Lancaster Dodd, the charismatic leader of a new \"religion\" he forms after World War II.', 'Drama', '', '', 'uBn5dURHsUg', '/tvhE7TWGzLPgN82bBDuX1XtH5oE.jpg', 1, ' ', '/qEWQ15QlMk96bwmBb8fL3XTZqAe.jpg', '/s4EIxjPG3BEmo6TWkCXkJQZM4zY.jpg', '137', 7.155),
(1014, 1, 'Andrei Rublev', 'tt0060107', '895', 1, '', 'Hollywood', '1966', 'An expansive Russian drama, this film focuses on the life of revered religious icon painter Andrei Rublev. Drifting from place to place in a tumultuous era, the peace-seeking monk eventually gains a reputation for his art. But after Rublev witnesses a brutal battle and unintentionally becomes involved, he takes a vow of silence and spends time away from his work. As he begins to ease his troubled soul, he takes steps towards becoming a painter once again.', 'Drama', 'History', '', 'fYy9lhLqtEw', '/910xRIUmNJrWH2hkQifBJtoPp5R.jpg', 1, ' ', '/cZstumfjHrAKx2hFum0Ur4uciXZ.jpg', '/fKa8Jy2ge1O0IU6zZXnJ2sxUzdU.jpg', '183', 8.1),
(1015, 1, 'The Grand Budapest Hotel', 'tt2278388', '120467', 1, '', 'Hollywood', '2014', 'The Grand Budapest Hotel tells of a legendary concierge at a famous European hotel between the wars and his friendship with a young employee who becomes his trusted protégé. The story involves the theft and recovery of a priceless Renaissance painting, the battle for an enormous family fortune and the slow and then sudden upheavals that transformed Europe during the first half of the 20th century.', 'Comedy', 'Drama', '', 'FIlqIj0fuk0', '/eWdyYQreja6JGCzqHWXpWHDrrPo.jpg', 1, ' ', '/bTWbXmZjNHwPT0gLsIz7HEVjOud.jpg', '/xHDynIimfsgj0ZOs0j5ma8v1vmM.jpg', '100', 8.052),
(1016, 1, 'Fanny and Alexander', 'tt0083922', '5961', 1, '', 'Hollywood', '1982', 'As children in the loving Ekdahl family, Fanny and Alexander enjoy a happy life with their parents, who run a theater company. After their father dies unexpectedly, however, the siblings end up in a joyless home when their mother, Emilie, marries a stern bishop. The bleak situation gradually grows worse as the bishop becomes more controlling, but dedicated relatives make a valiant attempt to aid Emilie, Fanny and Alexander.', 'Fantasy', 'Drama', 'Mystery', 'MVHjqThO1ek', '/q8jlA3Wc1Z987hNKRFA44g5OugC.jpg', 1, ' ', '/jVzoKlWUpsKV3y5oLafLQhEvgX6.jpg', '/jVzoKlWUpsKV3y5oLafLQhEvgX6.jpg', '188', 7.8),
(1017, 1, 'Miller\'s Crossing', 'tt0100150', '379', 1, '', 'Hollywood', '1990', 'Set in 1929, a political boss and his advisor have a parting of the ways when they both fall for the same woman.', 'Drama', 'Thriller', 'Crime', 'R1kRUyVeEOg', '/ab3pnsTKp3BgcAFy0FgWBFBg9FL.jpg', 1, ' ', '/4V2yyI65Ai2UhbKG014JUlv4Wfg.jpg', '/xeLOCSy9YIpGFYjcHiDTQ7ac65t.jpg', '115', 7.457),
(1018, 1, 'Casablanca', 'tt0034583', '289', 1, '', 'Hollywood', '1943', 'In Casablanca, Morocco in December 1941, a cynical American expatriate meets a former lover, with unforeseen complications.', 'Drama', 'Romance', '', 'ED3l5fWzFio', '/5K7cOHoay2mZusSLezBOY0Qxh8a.jpg', 1, ' ', '/tfNuePdHrP9fp6K2VTJwHKKJf8C.jpg', '/wOfzdzC0QZyhUIlyjeMuUYSb8Ax.jpg', '102', 8.2),
(1019, 1, '8½', 'tt0056801', '422', 1, '', 'Hollywood', '1963', 'Guido Anselmi, a film director, finds himself creatively barren at the peak of his career. Urged by his doctors to rest, Anselmi heads for a luxurious resort, but a sorry group gathers—his producer, staff, actors, wife, mistress, and relatives—each one begging him to get on with the show. In retreat from their dependency, he fantasizes about past women and dreams of his childhood.', 'Drama', '', '', '0dEKaNDqDmo', '/uFkdfTgHdp9xbpJwCY0cneVpXa7.jpg', 1, ' ', '/hiXMQiwpa0fqPJxWLSMWTbpiWn8.jpg', '/hiXMQiwpa0fqPJxWLSMWTbpiWn8.jpg', '139', 8.164),
(1020, 1, 'It\'s a Wonderful Life', 'tt0038650', '1585', 1, '', 'Hollywood', '1946', 'A holiday favourite for generations...  George Bailey has spent his entire life giving to the people of Bedford Falls.  All that prevents rich skinflint Mr. Potter from taking over the entire town is George\'s modest building and loan company.  But on Christmas Eve the business\'s $8,000 is lost and George\'s troubles begin.', 'Drama', 'Family', 'Fantasy', '9h39W2fI8u0', '/mV3VcmMJN6Zwahj42dy9WwPUyRI.jpg', 1, ' ', '/cRhAp2Wn2zXyPANjKxJ5UPbIfTJ.jpg', '/ch3lDc4xQ9MpsNEpnRhvR8PIxxK.jpg', '130', 8.264),
(1021, 1, 'It', 'tt1396484', '346364', 1, '', 'Hollywood', '2017', 'In a small town in Maine, seven children known as The Losers Club come face to face with life problems, bullies and a monster that takes the shape of a clown called Pennywise.', 'Horror', 'Fantasy', '', 'fYPjlNFvS_8', '/9E2y5Q7WlCVNEhP5GiVTjhEhx1o.jpg', 1, ' ', '/AqkavSN7zSPip4UQ5IpGuATqiwN.jpg', '/tcheoA2nPATCm2vvXw2hVQoaEFD.jpg', '135', 7.243),
(1022, 1, 'Brokeback Mountain', 'tt0388795', '142', 1, '', 'Hollywood', '2005', 'Rodeo cowboy Jack and ranch hand Ennis are hired as sheepherders in 1963 Wyoming. One night on Brokeback Mountain, they spark a physical relationship. Though Ennis marries his longtime sweetheart and Jack marries a fellow rodeo rider, they keep up their tortured, sporadic love affair for 20 years.', 'Drama', 'Romance', '', 'oV61fj1t8GA', '/zdRHBUTkkRK5GskoZUHjjUepZI7.jpg', 1, ' ', '/arsn3fOtlPnzbvlJE5OMVxbK7h2.jpg', '/3KyAxlakmcyHWqlcxgIxMQnSilk.jpg', '134', 7.8),
(1023, 1, 'Big Fish', 'tt0319061', '587', 1, '', 'Hollywood', '2003', 'Throughout his life Edward Bloom has always been a man of big appetites, enormous passions and tall tales. In his later years, he remains a huge mystery to his son, William. Now, to get to know the real man, Will begins piecing together a true picture of his father from flashbacks of his amazing adventures.', 'Adventure', 'Fantasy', 'Drama', 'T6M-jwyz28U', '/tjK063yCgaBAluVU72rZ6PKPH2l.jpg', 1, ' ', '/xN3xKxD6TI87RuGZXsiF1fMjN6Z.jpg', '/bLqUd0tBvKezDr9MEla7k34i3rp.jpg', '125', 7.764),
(1024, 1, 'A River Runs Through It', 'tt0105265', '293', 1, '', 'Hollywood', '1992', 'A River Runs Through It is a cinematographically stunning true story of Norman Maclean. The story follows Norman and his brother Paul through the experiences of life and growing up, and how their love of fly fishing keeps them together despite varying life circumstances in the untamed west of Montana in the 1920s.', 'Drama', 'Family', '', 'QFa7ptO3CGs', '/rL4odYIaO0xcksUQ9qzRFfU6lH2.jpg', 1, ' ', '/7hhtE2A5S7A8X3aouRQzzKliCcl.jpg', '/txuQpoWlGnlaxCTRVBkjqCDjssP.jpg', '123', 7.028),
(1025, 1, 'The Sound of Music', 'tt0059742', '15121', 1, '', 'Hollywood', '1965', 'In the years before the Second World War, a tomboyish postulant at an Austrian abbey is hired as a governess in the home of a widowed naval captain with seven children, and brings a new love of life and music into the home.', 'Drama', 'Family', 'Music', 'UY6uw3WpPzY', '/5qQTu2iGTiQ2UvyGp0beQAZ2rKx.jpg', 1, ' ', '/b2DtNHw5BWTneUX4yvNpU4Buq9q.jpg', '/5D9wsIoGLbwbJ4wdvME6Gb6zJNK.jpg', '174', 7.708),
(1026, 1, 'Marie Antoinette', 'tt0422720', '1887', 1, '', 'Hollywood', '2006', 'An Austrian teenager marries the Dauphin  of France and becomes that country\'s queen following the death of King Louis XV  in 1774. Years later, after a life of luxury and privilege, Marie Antoinette loses her head during the French Revolution.', 'Drama', 'History', '', 'yBWyKRoh98U', '/cybXGmv8Rjd5Os8Xml6YxMBQ0Zt.jpg', 1, ' ', '/gL6EwcDuyt1jvLEGcxxCBer97t.jpg', '/hlbRkinr9YcC3UOc871Df5zu9Ly.jpg', '123', 6.672),
(1027, 1, 'Pan\'s Labyrinth', 'tt0457430', '1417', 1, '', 'Hollywood', '2006', 'Living with her tyrannical stepfather in a new home with her pregnant mother, 10-year-old Ofelia feels alone until she explores a decaying labyrinth guarded by a mysterious faun who claims to know her destiny. If she wishes to return to her real father, Ofelia must complete three terrifying tasks.', 'Fantasy', 'Drama', 'War', '3tOP9xOhkvA', '/7PurMm0gUOJZ8Uk0oyuZlt1CKfJ.jpg', 1, ' ', '/lv2KNe8CRMSTy6O23nDRNflP5ic.jpg', '/o0IWa75BXyXryNDVqw0xoXZzy1J.jpg', '118', 7.757),
(1028, 1, 'Grave of the Fireflies', 'tt0095327', '12477', 1, '', 'Hollywood', '1988', 'In the final months of World War II, 14-year-old Seita and his sister Setsuko are orphaned when their mother is killed during an air raid in Kobe, Japan. After a falling out with their aunt, they move into an abandoned bomb shelter. With no surviving relatives and their emergency rations depleted, Seita and Setsuko struggle to survive.', 'Animation', 'Drama', 'War', '4vPeTSRd580', '/k9tv1rXZbOhH7eiCk378x61kNQ1.jpg', 1, ' ', '/k3oaaAOWfZbcQ9FN7gAJD2gsrPK.jpg', '/dlC0ed9Ugh3FzydnkBtV5lRXUu4.jpg', '89', 8.456),
(1029, 1, 'The Great Gatsby', 'tt1343092', '64682', 1, '', 'Hollywood', '2013', 'An adaptation of F. Scott Fitzgerald\'s Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsby\'s nouveau riche existence, where obsession, madness, and tragedy await.', 'Drama', 'Romance', '', '4Eo9x77cYpc', '/tyxfCBQv6Ap74jcu3xd7aBiaa29.jpg', 1, ' ', '/fSNjwPAP8e68vfOtbr5O6uNLt5C.jpg', '/tb440cwQMRoVHnhYJlzlxfv1ikm.jpg', '143', 7.374),
(1030, 1, 'Dances with Wolves', 'tt0099348', '581', 1, '', 'Hollywood', '1990', 'Wounded Civil War soldier, John Dunbar tries to commit suicide—and becomes a hero instead. As a reward, he\'s assigned to his dream post, a remote junction on the Western frontier, and soon makes unlikely friends with the local Sioux tribe.', 'Adventure', 'Drama', 'Western', 'N4gr-uXUg1M', '/hw0ZEHAaTqTxSXGVwUFX7uvanSA.jpg', 1, ' ', '/yT5BPehgZpYmmDJcRIiyDcEJOkf.jpg', '/f6YvaVqqNjAHYI4uC64ChpwqrUg.jpg', '181', 7.847),
(1031, 1, 'One Day', 'tt1563738', '51828', 1, '', 'Hollywood', '2011', 'A romantic comedy centered on Dexter and Emma, who first meet during their graduation in 1988 and proceed to keep in touch regularly. The film follows what they do on July 15 annually, usually doing something together.', 'Drama', 'Romance', '', 'hgMRJEhaVB4', '/n9jMwSg4IavdD8wqdYnyW5w3Mvp.jpg', 1, ' ', '/qwMKuCbPcGQaTuf6lGA3WVrObXv.jpg', '/4gN3BLe8MBS7cykyv4pxspLEc7c.jpg', '107', 7.422),
(1032, 1, 'Maggie', 'tt1881002', '287424', 1, '', 'Hollywood', '2015', 'There\'s a deadly zombie epidemic threatening humanity, but Wade, a small-town farmer and family man, refuses to accept defeat even when his daughter Maggie becomes infected. As Maggie\'s condition worsens and the authorities seek to eradicate those with the virus, Wade is pushed to the limits in an effort to protect her. Joely Richardson co-stars in this post-apocalyptic thriller.', 'Horror', 'Drama', '', 'UgjrjR42Ado', '/twa9gXjocLM629sJrQYVtmF306R.jpg', 1, ' ', '/kfCWMtc3Wly3WvxSQk3wu0lGz0S.jpg', '/rHUKzMqqsrXQjRO8OobnKy2qZ4Z.jpg', '95', 5.4),
(1033, 1, 'Maggie\'s Plan', 'tt3471098', '312669', 1, '', 'Hollywood', '2016', 'Maggie\'s plan to have a baby on her own is derailed when she falls in love with John, a married man, destroying his volatile marriage to the brilliant and impossible Georgette. But one daughter and three years later, Maggie is out of love and in a quandary: what do you do when you suspect your man and his ex wife are actually perfect for each other?', 'Romance', 'Comedy', 'Drama', 'LdFXvR7lQCw', '/aKU7hEGXVi4Up18w0DCnQ2wj8kA.jpg', 1, ' ', '/tTXyvKbaH1xXI88wiXCFX1chw1d.jpg', '/kZP6P3vlG40uK07vwlzlzlKdDA.jpg', '98', 5.7),
(1034, 1, 'Ballerina', 'tt2261287', '342473', 1, '', 'Hollywood', '2016', 'Set in 1879 Paris. An orphan girl dreams of becoming a ballerina and flees her rural Brittany for Paris, where she passes for someone else and accedes to the position of pupil at the Grand Opera house.', 'Animation', 'Adventure', 'Comedy', 'h-huA2o6OOY', '/qBxMhcmNnFniuDAZTKEHcSgKtsn.jpg', 1, ' ', '/gpfkL568wK7Ps1Iu0MknDKcCxPm.jpg', '/wlLdcK3Sm7zp0w1ZuVvnFlmcchM.jpg', '89', 7.2),
(1035, 1, 'Wish', 'tt11304740', '1022796', 1, '', 'Hollywood', '2023', 'Asha, a sharp-witted idealist, makes a wish so powerful that it is answered by a cosmic force – a little ball of boundless energy called Star. Together, Asha and Star confront a most formidable foe - the ruler of Rosas, King Magnifico - to save her community and prove that when the will of one courageous human connects with the magic of the stars, wondrous things can happen.', 'Animation', 'Family', 'Fantasy', 'voNI4boN0wE', '/AcoVfiv1rrWOmAdpnAMnM56ki19.jpg', 1, ' ', '/qdskwF31vjnthI5CTtExpjRwi9W.jpg', '/ehumsuIBbgAe1hg343oszCLrAfI.jpg', '95', 6.673),
(1036, 1, 'Queen & Slim', 'tt8722346', '536743', 1, '', 'Hollywood', '2019', 'While on a forgettable first date together in Ohio, a black man and a black woman are pulled over for a minor traffic infraction. The situation escalates, with sudden and tragic results.', 'Drama', 'Romance', 'Crime', '6cuQLO5WdlQ', '/qfIJOmsiBcum6EGosiy5gTF6ihk.jpg', 1, ' ', '/c9pyOSFJfL2MDANaXcmMOIGJQee.jpg', '/MmDgXMjZhD7rSH74mPrQj3uZaI.jpg', '131', 7.2),
(1037, 1, 'Sound of Metal', 'tt5363618', '502033', 1, '', 'Hollywood', '2020', 'Metal drummer Ruben begins to lose his hearing. When a doctor tells him his condition will worsen, he thinks his career and life is over. His girlfriend Lou checks the former addict into a rehab for the deaf hoping it will prevent a relapse and help him adapt to his new life. After being welcomed and accepted just as he is, Ruben must choose between his new normal and the life he once knew.', 'Drama', 'Music', '', 'VFOrGkAvjAE', '/3178oOJKKPDeQ2legWQvMPpllv.jpg', 1, ' ', '/cbfVEIkcMD65Pz9gwg5P4dj6D2N.jpg', '/7b5R8FfGUzlxfhOkPpL3xyIeuyF.jpg', '121', 7.743),
