(1067, 1, 'The Breakfast Club', 'tt0088847', '2108', 1, '', 'Hollywood', '1985', 'Five high school students from different walks of life endure a Saturday detention under a power-hungry principal. The disparate group includes rebel John, princess Claire, outcast Allison, brainy Brian and Andrew, the jock. Each has a chance to tell his or her story, making the others see them a little differently -- and when the day ends, they question whether school will ever be the same.', 'Comedy', 'Drama', '', 'opmr0naR9Lo', '/vSqk5BeQ1HvP9wq0rWZyWqiwXeF.jpg', 1, ' ', '/5GbGHRnQCOHARgxCjRe8pfnsI79.jpg', '/qpPFF8Sed5lkXngWraJdN8WkwDG.jpg', '98', 7.752),
