(1069, 1, 'The Deer Hunter', 'tt0077416', '11778', 1, '', 'Hollywood', '1978', 'A group of working-class friends decide to enlist in the Army during the Vietnam War and finds it to be hellish chaos -- not the noble venture they imagined. Before they left, Steven married his pregnant girlfriend -- and Michael and Nick were in love with the same woman. But all three are different men upon their return.', 'Drama', 'War', '', '7gzIo_tui3M', '/bbGtogDZOg09bm42KIpCXUXICkh.jpg', 1, ' ', '/uOMUJoon86IqYk11UL4vZQzhHpF.jpg', '/a5zBQfXmLk3qqRYF7AioWpiAxk2.jpg', '183', 7.998),
