(1071, 1, 'Spiral: From the Book of Saw', 'tt10342730', '602734', 1, '', 'Hollywood', '2021', 'Working in the shadow of an esteemed police veteran, brash Detective Ezekiel “Zeke” Banks and his rookie partner take charge of a grisly investigation into murders that are eerily reminiscent of the city’s gruesome past.  Unwittingly entrapped in a deepening mystery, Zeke finds himself at the center of the killer’s morbid game.', 'Horror', 'Crime', 'Mystery', 'x2n1GocGY0c', '/8rORNBvvxiE9lq0Swbpar8iQNW8.jpg', 1, ' ', '/d4SzJNjl2sxqbfoRYcPuSUa7QVB.jpg', '/g15PR8eQV9DehSWlagvdnJZqoRq.jpg', '93', 6.001),
