(1073, 1, 'Romeo + Juliet', 'tt0117509', '454', 1, '', 'Hollywood', '1996', 'In director Baz Luhrmann\'s contemporary take on William Shakespeare\'s classic tragedy, the Montagues and Capulets have moved their ongoing feud to the sweltering suburb of Verona Beach, where Romeo and Juliet fall in love and secretly wed. Though the film is visually modern, the bard\'s dialogue remains.', 'Drama', 'Romance', '', 'JcYWgDNuvUQ', '/eLf4jclPijOqfEp6bDAmezRFxk5.jpg', 1, ' ', '/vyDBLP7xw0VrDncSVKaDiyV5TI9.jpg', '/m0miV65ZZIp13TNHJSRUF6vmCos.jpg', '120', 6.794),
