(1076, 1, 'The Time Traveler\'s Wife', 'tt0452694', '24420', 1, '', 'Hollywood', '2009', 'Due to a genetic disorder, handsome librarian Henry DeTamble involuntarily zips through time, appearing at various moments in the life of his true love, the beautiful artist Clare Abshire.', 'Drama', 'Romance', 'Fantasy', '3_8WZxHScMk', '/J3ewuzQwhFro0pDpdcbZ4j7MYy.jpg', 1, ' ', '/x05tQYSvdGD4fYlEo8lcBO356Zk.jpg', '/3B4DbexR2hXINqJN6LqhmmAaVeS.jpg', '108', 6.934),
