(1078, 1, 'The Dreamers', 'tt0309987', '1278', 1, '', 'Hollywood', '2003', 'When Isabelle and Theo invite Matthew to stay with them, what begins as a casual friendship ripens into a sensual voyage of discovery and desire in which nothing is off limits and everything is possible.', 'Drama', 'Romance', '', 'VUcv1Ua7pzM', '/gBb7GGaFYPu7nEUYvC8G4LaJJN1.jpg', 1, ' ', '/clKa8yMJqSBgk2auTmRYIWMjF8F.jpg', '/xtvxa5Hu69blChmb5ndJ9poTkgB.jpg', '115', 7.2),
(1079, 1, 'Taxi Driver', 'tt0075314', '103', 1, '', 'Hollywood', '1976', 'A mentally unstable Vietnam War veteran works as a night-time taxi driver in New York City where the perceived decadence and sleaze feed his urge for violent action.', 'Crime', 'Drama', '', 'dB_5XEMH3mc', '/ekstpH614fwDX8DUln1a2Opz0N8.jpg', 1, ' ', '/gJa3S50e1pdkyVI9HdIP3LdCUH0.jpg', '/6aoyUbvu0419XLKLIMoH0TkEicH.jpg', '114', 8.155),
(1080, 1, 'Good Will Hunting', 'tt0119217', '489', 1, '', 'Hollywood', '1997', 'Will Hunting has a genius-level IQ but chooses to work as a janitor at MIT. When he solves a difficult graduate-level math problem, his talents are discovered by Professor Gerald Lambeau, who decides to help the misguided youth reach his potential. When Will is arrested for attacking a police officer, Professor Lambeau makes a deal to get leniency for him if he will get treatment from therapist Sean Maguire.', 'Drama', '', '', '_X0XUBOcsxI', '/bABCBKYBK7A5G1x0FzoeoNfuj2.jpg', 1, ' ', '/55NKVbGDqqsu5tlVmnKksrX7Wtw.jpg', '/bpV8wn48s82au37QyUJ51S7X2Vf.jpg', '127', 8.148),
(1081, 1, 'Home Alone', 'tt0099785', '771', 1, '', 'Hollywood', '1990', 'Eight-year-old Kevin McCallister makes the most of the situation after his family unwittingly leaves him behind when they go on Christmas vacation. But when a pair of bungling burglars set their sights on Kevin\'s house, the plucky kid stands ready to defend his territory. By planting booby traps galore, adorably mischievous Kevin stands his ground as his frantic mother attempts to race home before Christmas Day.', 'Comedy', 'Family', '', 'DpHw7pxRUtk', '/9wSbe4CwObACCQvaUVhWQyLR5Vz.jpg', 1, ' ', '/hrFfag6GnsGlyvcRXmnAuurwVAV.jpg', '/bCFhGBYSLFSVdZmBZ6sENhMmi2Z.jpg', '103', 7.417),
(1082, 1, 'Frida', 'tt0120679', '1360', 1, '', 'Hollywood', '2002', 'A biography of artist Frida Kahlo, who channeled the pain of a crippling injury and her tempestuous marriage into her work.', 'Drama', 'Romance', '', '-CTM7FcY1LE', '/a4hgR6aKoohB6MHni171jbi9BkU.jpg', 1, ' ', '/j6tbaFb9UbLOvmGRWIe9bLqFZ9F.jpg', '/s04Ds4xbJU7DzeGVyamccH4LoxF.jpg', '123', 7.422),
(1083, 1, 'Moonrise Kingdom', 'tt1748122', '83666', 1, '', 'Hollywood', '2012', 'Set on an island off the coast of New England in the summer of 1965, Moonrise Kingdom tells the story of two twelve-year-olds who fall in love, make a secret pact, and run away together into the wilderness. As various authorities try to hunt them down, a violent storm is brewing off-shore – and the peaceful island community is turned upside down in more ways than anyone can handle.', 'Comedy', 'Drama', 'Romance', 'p9wrJJP68ps', '/xrziXRHRQ7c7YLIehgSJY8GQBsx.jpg', 1, ' ', '/9lARefvwwjSvHai0ruqwKNqA9Jz.jpg', '/bsYv9IFIGfpAV0oUbe7YTiyxhox.jpg', '94', 7.689),
(1084, 1, 'Children of Men', 'tt0206634', '9693', 1, '', 'Hollywood', '2006', 'In 2027, in a chaotic world in which humans can no longer procreate, a former activist agrees to help transport a miraculously pregnant woman to a sanctuary at sea, where her child\'s birth may help scientists save the future of humankind.', 'Drama', 'Action', 'Thriller', 'htXi5ty4_Yg', '/k9IAS4TehZFcKi4HVByxZNPfqex.jpg', 1, ' ', '/eOddeauL0Z4J2Y1LFTtjdi3jLxE.jpg', '/7cW7zHpDdl9fgaRXI5qAglV247P.jpg', '109', 7.607),
(1085, 1, 'The Truman Show', 'tt0120382', '37165', 1, '', 'Hollywood', '1998', 'Truman Burbank is the star of The Truman Show, a 24-hour-a-day reality TV show that broadcasts every aspect of his life without his knowledge. His entire life has been an unending soap opera for consumption by the rest of the world. And everyone he knows, including his wife and his best friend, is really an actor, paid to be part of his life.', 'Comedy', 'Drama', '', 'gPPN8OPYMsQ', '/vuza0WqY239yBXOadKlGwJsZJFE.jpg', 1, ' ', '/zV8aR6sFUMq6jZnNPx25IWA17DL.jpg', '/aCHn2TXYJfzPXQKA6r9mKPbMlUB.jpg', '103', 8.135),
(1086, 1, 'Gone with the Wind', 'tt0031381', '770', 1, '', 'Hollywood', '1939', 'The spoiled daughter of a Georgia plantation owner conducts a tumultuous romance with a cynical profiteer during the American Civil War and Reconstruction Era.', 'Drama', 'War', 'Romance', 'fgdCVxmPMVE', '/lNz2Ow0wGCAvzckW7EOjE03KcYv.jpg', 1, ' ', '/aFoqf4Q7HUT20OozQjIXr8JuMBq.jpg', '/ft8WRF2xqEwwGWa59naDUybKTAx.jpg', '233', 7.966),
(1087, 1, 'Alatriste', 'tt0395119', '13495', 1, '', 'Hollywood', '2006', 'In 17th century Spain Diego Alatriste, a brave and heroic soldier, is fighting in his King\'s army in the Flandes region. His best mate, Balboa, falls in a trap and, near to death, asks Diego to look after his son and teach him to be a soldier.', 'Action', '', '', 'lDS09DDpY14', '/iffLhhLtTNODIiCbrIxQMtQjkNS.jpg', 1, ' ', '/gH5Qk68EpMhLaALpymiu2kbtb8l.jpg', '/gH5Qk68EpMhLaALpymiu2kbtb8l.jpg', '145', 5.8),
(1088, 1, 'Donnie Darko', 'tt0246578', '141', 1, '', 'Hollywood', '2001', 'After narrowly escaping a bizarre accident, a troubled teenager is plagued by visions of a large bunny rabbit that manipulates him to commit a series of crimes.', 'Fantasy', 'Drama', 'Mystery', 'bzLn8sYeM9o', '/fhQoQfejY1hUcwyuLgpBrYs6uFt.jpg', 1, ' ', '/evJNmqaJdTf2B8VRhOLOWUdBRGb.jpg', '/msCHK5Kh1YbdZ0zPJ2nzPUhhSN9.jpg', '114', 7.783),
(1089, 1, 'Memento', 'tt0209144', '77', 1, '', 'Hollywood', '2000', 'Leonard Shelby is tracking down the man who raped and murdered his wife. The difficulty of locating his wife\'s killer, however, is compounded by the fact that he suffers from a rare, untreatable form of short-term memory loss. Although he can recall details of life before his accident, Leonard cannot remember what happened fifteen minutes ago, where he\'s going, or why.', 'Mystery', 'Thriller', '', 'Rq9eM4ZXRgs', '/yuNs09hvpHVU1cBTCAk9zxsL2oW.jpg', 1, ' ', '/5wmhPm9UmAFsVAwYjk5ZDjuqoW0.jpg', '/q2CtXYjp9IlnfBcPktNkBPsuAEO.jpg', '113', 8.188),
(1090, 1, 'Fight Club', 'tt0137523', '550', 1, '', 'Hollywood', '1999', 'A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.', 'Drama', '', '', 'dfeUzm6KF4g', '/pB8BM7pdSp6B6Ih7QZ4DrQ3PmJK.jpg', 1, ' ', '/fygeMr16EcxJiYhdiO1LEr7iHtI.jpg', '/hZkgoQYus5vegHoetLkCJzb17zJ.jpg', '139', 8.44),
(1091, 1, 'Vertigo', 'tt0052357', '426', 1, '', 'Hollywood', '1958', 'A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend\'s wife, all the while becoming dangerously obsessed with her.', 'Mystery', 'Romance', 'Thriller', 'AznSJTfOT3c', '/15uOEfqBNTVtDUT7hGBVCka0rZz.jpg', 1, ' ', '/jdusFrnKhbDBUIHNzFTK9uDsmwU.jpg', '/5zKeHHFYfuyH0KFR7h3IYnOHL7v.jpg', '128', 8.175),
(1092, 1, 'The Prestige', 'tt0482571', '1124', 1, '', 'Hollywood', '2006', 'A mysterious story of two magicians whose intense rivalry leads them on a life-long battle for supremacy -- full of obsession, deceit and jealousy with dangerous and deadly consequences.', 'Drama', 'Mystery', 'Science Fiction', 'ijXruSzfGEc', '/tRNlZbgNCNOpLpbPEz5L8G8A0JN.jpg', 1, ' ', '/8qNI1E7jprDtCVoWKhXFagrP6ox.jpg', '/xBDE2d6HM1aBKQRu4IT7SfPD9fs.jpg', '130', 8.205),
(1093, 1, 'A Nightmare on Elm Street', 'tt0087800', '377', 1, '', 'Hollywood', '1984', 'Teenagers in a small town are dropping like flies, apparently in the grip of mass hysteria causing their suicides. A cop\'s daughter, Nancy Thompson, traces the cause to child molester Fred Krueger, who was burned alive by angry parents many years before. Krueger has now come back in the dreams of his killers\' children, claiming their lives as his revenge. Nancy and her boyfriend, Glen, must devise a plan to lure the monster out of the realm of nightmares and into the real world...', 'Horror', '', '', '7q_klUFLAKs', '/wGTpGGRMZmyFCcrY2YoxVTIBlli.jpg', 1, ' ', '/u9Izap5fRHGR0S9om2KSm9eGFYR.jpg', '/g9ROrZey0JYp7kf8DoAyZtKnObj.jpg', '91', 7.327),
(1094, 1, 'The Place Beyond the Pines', 'tt1817273', '97367', 1, '', 'Hollywood', '2013', 'A motorcycle stunt rider considers committing a crime in order to provide for his wife and child, an act that puts him on a collision course with a cop-turned-politician.', 'Drama', 'Crime', '', 'VVdegQM0Quw', '/vY5j2xQzMGWmxBuhQo0HfA4Lxqb.jpg', 1, ' ', '/6VRKBfA9Bz0urfaQJRIOA8A6dhy.jpg', '/diPHTkeV6UFskO96OSCy1PCh4Rr.jpg', '140', 6.966),
(1095, 1, 'Uncut Gems', 'tt5727208', '473033', 1, '', 'Hollywood', '2019', 'A charismatic New York City jeweler always on the lookout for the next big score makes a series of high-stakes bets that could lead to the windfall of a lifetime. Howard must perform a precarious high-wire act, balancing business, family, and encroaching adversaries on all sides in his relentless pursuit of the ultimate win.', 'Drama', 'Thriller', 'Crime', 'dlUE7ruqrv0', '/6XN1vxHc7kUSqNWtaQKN45J5x2v.jpg', 1, ' ', '/ihQIgiM73tkYK9I2nFpYebUvit6.jpg', '/uzvT6tYrU5SxfHe1ieimIGAqyFm.jpg', '136', 7.147),
(1096, 1, 'Chef', 'tt2883512', '212778', 1, '', 'Hollywood', '2014', 'When Chef Carl Casper suddenly quits his job at a prominent Los Angeles restaurant after refusing to compromise his creative integrity for its controlling owner, he is left to figure out what\'s next. Finding himself in Miami, he teams up with his ex-wife, his friend and his son to launch a food truck. Taking to the road, Chef Carl goes back to his roots to reignite his passion for the kitchen -- and zest for life and love.', 'Comedy', '', '', 'FF_rYNupPwg', '/yMtKHR6VG1Yagvv5F7IFpsGBm66.jpg', 1, ' ', '/ddkUQ7qEGXBqPn3vkxGkKLmzrX8.jpg', '/12rDMkiQFeXrLhlIbJpArL8wOHf.jpg', '114', 7.1),
