(1098, 1, 'Clueless', 'tt0112697', '9603', 1, '', 'Hollywood', '1995', 'Shallow, rich and socially successful Cher is at the top of her Beverly Hills high school\'s pecking scale. Seeing herself as a matchmaker, Cher first coaxes two teachers into dating each other. Emboldened by her success, she decides to give hopelessly klutzy new student Tai a makeover. When Tai becomes more popular than she is, Cher realizes that her disapproving ex-stepbrother was right about how misguided she was -- and falls for him.', 'Comedy', 'Romance', '', 'KeGqX4GVBZE', '/8AwVTcgpTnmeOs4TdTWqcFDXEsA.jpg', 1, ' ', '/vznH0sXgmHnLbbkp0ZG67nWYUB0.jpg', '/2FonLz0RPxbBriOlZ9mWhYdlqCp.jpg', '97', 7.272),
(1099, 1, 'Bring It On', 'tt0204946', '1588', 1, '', 'Hollywood', '2000', 'The Toro cheerleading squad from Rancho Carne High School in San Diego has got spirit, spunk, sass and a killer routine that\'s sure to land them the national championship trophy for the sixth year in a row. But for newly-elected team captain Torrance, the Toros\' road to total cheer glory takes a shady turn when she discovers that their perfectly-choreographed routines were in fact stolen.', 'Comedy', '', '', '4Fza-ZDQE6c', '/uPkiecNHlBdSlQVG6s1NN2FLluF.jpg', 1, ' ', '/chQ7r8gGkzBSSuqcGffUIokEIpd.jpg', '/chQ7r8gGkzBSSuqcGffUIokEIpd.jpg', '98', 6.231),
(1100, 1, 'The Princess Diaries', 'tt0247638', '9880', 1, '', 'Hollywood', '2001', 'A socially awkward but very bright 15-year-old girl being raised by a single mom discovers that she is the princess of a small European country because of the recent death of her long-absent father, who, unknown to her, was the crown prince of Genovia. She must make a choice between continuing the life of a San Francisco teen or stepping up to the throne.', 'Comedy', 'Family', 'Romance', '2CkcwPi20ms', '/wA4lgl8gmoICSShviCkEB61nIBB.jpg', 1, ' ', '/lGa7l6ZQUQ3BJbrUnjkBxNfcpw7.jpg', '/gHtCBCQrzT6MvCylcvgFWPMZ1E2.jpg', '115', 6.945),
(1101, 1, '13 Going on 30', 'tt0337563', '10096', 1, '', 'Hollywood', '2004', 'After total humiliation at her thirteenth birthday party, Jenna Rink wants to just hide until she\'s thirty. With a little magic, her wish is granted, but it turns out that being thirty isn\'t as always as awesome as she thought it would be!', 'Comedy', 'Fantasy', 'Romance', 'JOdROZiXcy4', '/iNZdSIfhSCMtRILDNyhLn8UKeSG.jpg', 1, ' ', '/pZeqKRcVSoGA07lAb017h4hFeLF.jpg', '/gBwujuep3xyjkPVbcLfhZ9sOHLP.jpg', '98', 6.738),
