(1104, 1, 'Mamma Mia!', 'tt0795421', '11631', 1, '', 'Hollywood', '2008', 'An independent, single mother who owns a small hotel on a Greek island is about to marry off the spirited young daughter she\'s raised alone. But, the daughter has secretly invited three of her mother\'s ex-lovers in the hopes of finding her biological father.', 'Comedy', 'Romance', '', '-L_QYli9hKw', '/zdUA4FNHbXPadzVOJiU0Rgn6cHR.jpg', 1, ' ', '/dsSodbJrJoafzMz4zheuKZ4PeUw.jpg', '/ns9T8glyF7mYwxrcUHXm22nMf9t.jpg', '108', 6.969),
(1105, 1, 'Julie & Julia', 'tt1135503', '24803', 1, '', 'Hollywood', '2009', 'Julia Child and Julie Powell – both of whom wrote memoirs – find their lives intertwined. Though separated by time and space, both women are at loose ends... until they discover that with the right combination of passion, fearlessness and butter, anything is possible.', 'Romance', 'Drama', '', 'ozRK7VXQl-k', '/r1bFBBj3VMek0oEtgm9N51OqVjF.jpg', 1, ' ', '/pdYD34NA0RaCWcojaSQEqUGAVdj.jpg', '/1tWpsnSelznXfkdssCWQGgavRZM.jpg', '123', 6.697),
(1106, 1, 'Bohemian Rhapsody', 'tt1727824', '424694', 1, '', 'Hollywood', '2018', 'Singer Freddie Mercury, guitarist Brian May, drummer Roger Taylor and bass guitarist John Deacon take the music world by storm when they form the rock \'n\' roll band Queen in 1970. Hit songs become instant classics. When Mercury\'s increasingly wild lifestyle starts to spiral out of control, Queen soon faces its greatest challenge yet – finding a way to keep the band together amid the success and excess.', 'Music', 'Drama', '', 'eRpp0JZY8pk', '/lHu1wtNaczFPGFDTrjCSzeLPTKN.jpg', 1, ' ', '/cdakNMS02KILElwW4j7IZPEVw7D.jpg', '/dcvbs8z0GEXslC1kCT77x19XDeR.jpg', '135', 7.995),
