(1108, 1, 'The Devil Wears Prada', 'tt0458352', '350', 1, '', 'Hollywood', '2006', 'Andy moves to New York to work in the fashion industry. Her boss is extremely demanding, cruel and won\'t let her succeed if she doesn\'t fit into the high class elegant look of their magazine.', 'Comedy', 'Drama', 'Romance', '6ZOZwUQKu3E', '/8912AsVuS7Sj915apArUFbv6F9L.jpg', 1, ' ', '/82I0vDGt0l6QlC5kkCgZJiCR3bJ.jpg', '/CpLAfXgSNeNRRbRzPrTuzKmIHO.jpg', '109', 7.389),
