(1111, 1, 'Incendies', 'tt1255953', '46738', 1, '', 'Hollywood', '2010', 'A mother\'s last wishes send twins Jeanne and Simon on a journey to Middle East in search of their tangled roots. Adapted from Wajdi Mouawad\'s acclaimed play, Incendies tells the powerful and moving tale of two young adults\' voyage to the core of deep-rooted hatred, never-ending wars and enduring love.', 'Drama', 'War', 'Mystery', 'XJ69WnwvZhE', '/dGrSn4SsuC2EMfF7qqq491ukcU.jpg', 1, ' ', '/jNICaPciTja37SkbSZh4XCsA0Q6.jpg', '/jNICaPciTja37SkbSZh4XCsA0Q6.jpg', '131', 8.098),
(1112, 1, 'Perfect Blue', 'tt0156887', '10494', 1, '', 'Hollywood', '1998', 'Pop singer Mima Kirigow looks forward to a bright new career when she quits her chart-topping trio to become an actress. When she lands a role in a sexually charged murder mystery, Mima’s life begins to fall apart.', 'Animation', 'Thriller', '', 'pNO5BBKMO1k', '/kG4AZLcWilPYIixowm8pnE3DqfI.jpg', 1, ' ', '/A1Larywbw79kZQqkvCEiPHJqdLN.jpg', '/A1Larywbw79kZQqkvCEiPHJqdLN.jpg', '81', 8.293),
(1113, 1, 'Man Bites Dog', 'tt0103905', '10086', 1, '', 'Hollywood', '1992', 'The activities of rampaging, indiscriminate serial killer Ben are recorded by a willingly complicit documentary team, who eventually become his accomplices and active participants. Ben provides casual commentary on the nature of his work and arbitrary musings on topics of interest to him, such as music or the conditions of low-income housing, and even goes so far as to introduce the documentary crew to his family. But their reckless indulgences soon get the better of them.', 'Comedy', 'Crime', '', 'bcPhaieTg4o', '/wFjMK1QaH8an5JcgDEDoSReQ7aL.jpg', 1, ' ', '/tlrpQeCTPDXzhCNOmcs10VeUTaD.jpg', '/gaTO3416TGEZPQO6fF8QmOzbKoG.jpg', '96', 7.216),
(1114, 1, 'The Shawshank Redemption', 'tt0111161', '278', 1, '', 'Hollywood', '1994', 'Framed in the 1940s for the double murder of his wife and her lover, upstanding banker Andy Dufresne begins a new life at the Shawshank prison, where he puts his accounting skills to work for an amoral warden. During his long stretch in prison, Dufresne comes to be admired by the other inmates -- including an older prisoner named Red -- for his integrity and unquenchable sense of hope.', 'Drama', 'Crime', '', 'PLl99DlL6b4', '/q6y0Go1tsGEsmtFryDOJo3dEmqu.jpg', 1, ' ', '/xXXFdqV965crlxCO3dj3PhtcCAf.jpg', '/kXfqcdQKsToO0OUXHcrrNCHDBzO.jpg', '142', 8.706),
(1115, 1, 'Wayne\'s World', 'tt0105793', '8872', 1, '', 'Hollywood', '1992', 'The adventures of two amiably aimless metal-head friends, Wayne and Garth. From Wayne\'s basement, the pair broadcast a talk-show called \"Wayne\'s World\" on local public access television. The show comes to the attention of a sleazy network executive who wants to produce a big-budget version of \"Wayne\'s World\"—and he also wants Wayne\'s girlfriend, a rock singer named Cassandra. Wayne and Garth have to battle the executive not only to save their show, but also Cassandra.', 'Comedy', 'Music', '', 'j881Yzb3LP4', '/nhQtlLVl2z5ywu2uDnXjVqi08On.jpg', 1, ' ', '/7AbRSoh3ekjO3AWRGAat6Mo25g9.jpg', '/lbYqyfG6C3VcKPfKXOenn1aXUx5.jpg', '95', 6.699),
(1116, 1, 'Wayne\'s World 2', 'tt0108525', '8873', 1, '', 'Hollywood', '1993', 'A message from Jim Morrison in a dream prompts cable access TV stars Wayne and Garth to put on a rock concert, \"Waynestock,\" with Aerosmith as headliners. But amid the preparations, Wayne frets that a record producer is putting the moves on his girlfriend, Cassandra, while Garth handles the advances of mega-babe Honey Hornee.', 'Comedy', 'Music', '', 'Im4g7MOb-G0', '/xRzMaHvSJEBdqEVrscOnfyyCj2Y.jpg', 1, ' ', '/tTolTNqKiVAK7hMfpCQ3oZWy5ES.jpg', '/jI89CYhH2b0feShqNzj9whEVxTe.jpg', '95', 6.084),
(1117, 1, 'Ted', 'tt1637725', '72105', 1, '', 'Hollywood', '2012', 'John Bennett, a man whose childhood wish of bringing his teddy bear to life came true, now must decide between keeping the relationship with the bear or his girlfriend, Lori.', 'Comedy', 'Fantasy', '', 'n95L7k07e2s', '/1QVZXQQHCEIj8lyUhdBYd2qOYtq.jpg', 1, ' ', '/cfBHNVv9pto26a4qnwJ5F0gq9jg.jpg', '/wS9TiAS1WckeTS2IrFg5dRN9WQD.jpg', '107', 6.412),
(1118, 1, 'Ted 2', 'tt2637276', '214756', 1, '', 'Hollywood', '2015', 'Newlywed couple Ted and Tami-Lynn want to have a baby, but in order to qualify to be a parent, Ted will have to prove he\'s a person in a court of law.', 'Comedy', 'Fantasy', '', 'Gm8U89Oc8qA', '/qMOt0uy1x49OBW0jzodgRM9waW0.jpg', 1, ' ', '/sabbmaIKLDg13XUsmimM6jbrPfX.jpg', '/19Pghw34YdLbjeKpwfCRTNhaItr.jpg', '115', 6.291),
(1119, 1, 'Ferris Bueller\'s Day Off', 'tt0091042', '9377', 1, '', 'Hollywood', '1986', 'After high school slacker Ferris Bueller successfully fakes an illness in order to skip school for the day, he goes on a series of adventures throughout Chicago with his girlfriend Sloane and best friend Cameron, all the while trying to outwit his wily school principal and fed-up sister.', 'Comedy', '', '', 'GDttaV80_BM', '/9LTQNCvoLsKXP0LtaKAaYVtRaQL.jpg', 1, ' ', '/x2VTixZvBCU3HWYNVD9Xe8vZsia.jpg', '/lU0v9ULZJ9A5145nLGUF8ZNZnPj.jpg', '103', 7.602),
(1120, 1, 'Mermaids', 'tt0100140', '4587', 1, '', 'Hollywood', '1990', 'Fifteen-year-old Charlotte Flax is tired of her wacky mom moving their family to a different town any time she feels it is necessary. When they move to a small Massachusetts town and Mrs. Flax begins dating a shopkeeper, Charlotte and her 9-year-old sister, Kate, hope that they can finally settle down. But when Charlotte\'s attraction to an older man gets in the way, the family must learn to accept each other for who they truly are.', 'Comedy', 'Drama', 'Romance', 'qQ2OXEoO2sw', '/1VufMcp0euY2LpmKiVv8xnbB9Om.jpg', 1, ' ', '/wyO7MLJNaHCZ6xCYSoImkp1OhvU.jpg', '/mNEh6r2hCW05f2BwfDJOCBYrDME.jpg', '110', 6.715),
(1121, 1, 'Lemonade Mouth', 'tt1648204', '65218', 1, '', 'Hollywood', '2011', 'When five ragtag freshman first meet in detention, it seems they have nothing in common. But, through music, they form an unbreakable bond and discover they have the makings of the greatest high school garage band in history! In the face of incredible odds, Olivia, Stella, Wen, Mohini and Charlie find they can make a real difference when they learn to lean on each other and let go of everything holding back their dreams.', 'Drama', 'Comedy', 'TV Movie', 'Ecn8dvDK7LQ', '/5Tbbxf38c16kbfezmXkPYS2tYRN.jpg', 1, ' ', '/jJO6LLAruzpySTTJ3b7a2S42O2p.jpg', '/lBy0tIjlc3rAy4dih74RFDIpxoP.jpg', '106', 7.4),
(1122, 1, 'Freaky Friday', 'tt0322330', '10330', 1, '', 'Hollywood', '2003', 'Mother and daughter bicker over everything -- what Anna wears, whom she likes and what she wants to do when she\'s older. In turn, Anna detests Tess\'s fiancé. When a magical fortune cookie switches their personalities, they each get a peek at how the other person feels, thinks and lives.', 'Comedy', 'Family', 'Fantasy', '8C7L9ANISmI', '/ipKcZ4Up7dp18XpsfYUc9NKZy3g.jpg', 1, ' ', '/5G3iEw6muiygN5RzcJ62jWeRctZ.jpg', '/gOlMx8kFIIUmYVRIKuLbaLhBJSZ.jpg', '97', 6.476),
(1123, 1, 'Freaky', 'tt10919380', '551804', 1, '', 'Hollywood', '2020', 'A mystical, ancient dagger causes a notorious serial killer to magically switch bodies with a 17-year-old girl.', 'Comedy', 'Fantasy', 'Horror', 'RVi3FMW3zuo', '/8xC6QSyxrpm0D5A6iyHNemEWBVe.jpg', 1, ' ', '/kwBUrBcngaiBaFEeAS8ffV3DDQ2.jpg', '/rY26gy8isPcBLAe3NBIsVTPVb0Z.jpg', '102', 6.575),
(1124, 1, 'Her', 'tt1798709', '152601', 1, '', 'Hollywood', '2013', 'In the not so distant future, Theodore, a lonely writer, purchases a newly developed operating system designed to meet the user\'s every need. To Theodore\'s surprise, a romantic relationship develops between him and his operating system. This unconventional love story blends science fiction and romance in a sweet tale that explores the nature of love and the ways that technology isolates and connects us all.', 'Romance', 'Science Fiction', 'Drama', 'OPLcKRMAwiA', '/eCOtqtfvn7mxGl6nfmq4b1exJRc.jpg', 1, ' ', '/n4xCYYNLYTLe1frrUvS1I4G9Jfv.jpg', '/sPPsR9f4K0movWVQ99u4uMqFzEL.jpg', '126', 7.861),
(1125, 1, 'Persuasion', 'tt13456318', '820912', 1, '', 'Hollywood', '2022', 'Living with her snobby family on the brink of bankruptcy, Anne Elliot is an unconforming woman with modern sensibilities. When Frederick Wentworth - the dashing one she once sent away - crashes back into her life, Anne must choose between putting the past behind her or listening to her heart when it comes to second chances.', 'Romance', 'Drama', 'Comedy', 'kHxtET0VwDo', '/s99WrKSEVR4RVvwm5Zn2cqrHTMM.jpg', 1, ' ', '/sfXL4LqL5LXXyb2AeqZbwb2pSza.jpg', '/oE0J0zaLjJZkecx2seNH90YeSmk.jpg', '108', 5.954),
(1126, 1, 'Flipped', 'tt0817177', '43949', 1, '', 'Hollywood', '2010', 'When Juli meets Bryce in the second grade, she knows it\'s true love. After spending six years trying to convince Bryce the same, she\'s ready to give up - until he starts to reconsider.', 'Romance', 'Drama', '', 'aXeJ8NM7c9g', '/6zDYFigohwncqFL00MKbFV01dWb.jpg', 1, ' ', '/xBSwwkAYl9h8QVG2OxNpSaSgJwr.jpg', '/xBSwwkAYl9h8QVG2OxNpSaSgJwr.jpg', '89', 7.988),
(1127, 1, 'Hachi: A Dog\'s Tale', 'tt1028532', '28178', 1, '', 'Hollywood', '2009', 'A drama based on the true story of a college professor\'s bond with the abandoned dog he takes into his home.', 'Drama', 'Family', '', 'Y6U7mAnPtw4', '/lsy3aEsEfYIHdLRk4dontZ4s85h.jpg', 1, ' ', '/gqxbhJT8THJX68ECwIhz4zyBUH5.jpg', '/a5pOEjOLvr04Hr8qktIDM75OZi0.jpg', '93', 8.008),
(1128, 1, 'The Green Mile', 'tt0120689', '497', 1, '', 'Hollywood', '1999', 'A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cell block\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.', 'Fantasy', 'Drama', 'Crime', 'YVUz6xZXSzI', '/8VG8fDNiy50H4FedGwdSVUPoaJe.jpg', 1, ' ', '/5Nz25DPXfQaSpDgce42Y3kFg9G4.jpg', '/l6hQWH9eDksNJNiXWYRkWqikOdu.jpg', '189', 8.509),
(1129, 1, 'The Da Vinci Code', 'tt0382625', '591', 1, '', 'Hollywood', '2006', 'A murder in Paris’ Louvre Museum and cryptic clues in some of Leonardo da Vinci’s most famous paintings lead to the discovery of a religious mystery. For 2,000 years a secret society closely guards information that — should it come to light — could rock the very foundations of Christianity.', 'Thriller', 'Mystery', '', 'PHkW3TOl0-0', '/tYXOOkDxJ7jSvUX5j1Hbks1GjBZ.jpg', 1, ' ', '/bAWv9lkd5xxdEfdcxDOCrQMXEi5.jpg', '/66oSbVOmD4W7S6ILRPssYt51ab4.jpg', '149', 6.723),
(1130, 1, 'Divergent', 'tt1840309', '157350', 1, '', 'Hollywood', '2014', 'In a world divided into factions based on personality types, Tris learns that she\'s been classified as Divergent and won\'t fit in. When she discovers a plot to destroy Divergents, Tris and the mysterious Four must find out what makes Divergents dangerous before it\'s too late.', 'Action', 'Adventure', 'Science Fiction', 'sutgWjz10sM', '/aNh4Q3iuPKDMPi2SL7GgOpiLukX.jpg', 1, ' ', '/nrKGh3HZEWAdPIoObTlFFH6I5oC.jpg', '/ipikQozG6cAtLqhaFqRneA0LI4o.jpg', '139', 6.922),
(1131, 1, 'Parasite', 'tt6751668', '496243', 1, '', 'Hollywood', '2019', 'All unemployed, Ki-taek\'s family takes peculiar interest in the wealthy and glamorous Parks for their livelihood until they get entangled in an unexpected incident.', 'Comedy', 'Thriller', 'Drama', 'ccdTUEZsAW0', '/7IiTTgloJzvGI1TAYymCfbfl3vT.jpg', 1, ' ', '/gf1cTS5rYIgGDMvqjPZaTbD3Ycy.jpg', '/hiKmpZMGZsrkA3cdce8a7Dpos1j.jpg', '133', 8.514),
(1132, 1, 'Juno', 'tt0467406', '7326', 1, '', 'Hollywood', '2007', 'Faced with an unplanned pregnancy, sixteen year old high-schooler, Juno MacGuff, makes an unusual decision regarding her unborn child.', 'Comedy', 'Drama', 'Romance', 'miy1fE-8Z0U', '/jNIn2tVhpvFD6P9IojldI3mNYcn.jpg', 1, ' ', '/eiu1Rj79675HQGUw2Tp6wsMfTOq.jpg', '/sRXMmeNHTSWRYdDz3zaHNyyPJ0u.jpg', '96', 7.047),
(1133, 1, 'The Weekend Away', 'tt14817272', '840882', 1, '', 'Hollywood', '2022', 'When her best friend vanishes during a girls\' trip to Croatia, Beth races to figure out what happened. But each clue yields another unsettling deception.', 'Thriller', 'Mystery', '', '820j10lEAec', '/6MS0QEl7UK2gdFFbHfNwuYlsq4H.jpg', 1, ' ', '/qa6U1Y3eoY6arfTnmVS5yXgpHpq.jpg', '/ogBxTYI7TDSnkUONkwK4R8hM1lE.jpg', '90', 6.02),
(1134, 1, 'Security', 'tt3501112', '460846', 1, '', 'Hollywood', '2017', 'An ex-special services veteran, down on his luck and desperate for work, takes a job as a security guard at a run-down mall in a rough area of town. On his first night on the job, he opens the door to a distraught and desperate young girl who has fled the hijacking of a Police motorcade that was transporting her to testify as a witness in a trial. Hot on her heels is the psychopathic hijacker and his team of henchmen, who will stop at nothing to extract and eliminate the witness.', 'Action', 'Thriller', 'Crime', 'zbOqeh8VYCI', '/9FN5n8wGYrfSJaKGF9uObdKimIh.jpg', 1, ' ', '/wvzfCpT7i7ZkJ7A3CEfOloJ82Bj.jpg', '/41pWNOj2rqKSfsKayS4kAbzpsRt.jpg', '87', 6.262),
(1135, 1, 'Underwater', 'tt5774060', '443791', 1, '', 'Hollywood', '2020', 'After an earthquake destroys their underwater station, six researchers must navigate two miles along the dangerous, unknown depths of the ocean floor to make it to safety in a race against time.', 'Horror', 'Science Fiction', 'Action', 'i_CjLz2LNpQ', '/gzlbb3yeVISpQ3REd3Ga1scWGTU.jpg', 1, ' ', '/o2TqmydNKI1GPr5rjZAe1Um2gsH.jpg', '/ww7eC3BqSbFsyE5H5qMde8WkxJ2.jpg', '95', 6.299),
(1136, 1, 'Lost in Translation', 'tt0335266', '153', 1, '', 'Hollywood', '2003', 'Two lost souls visiting Tokyo -- the young, neglected wife of a photographer and a washed-up movie star shooting a TV commercial -- find an odd solace and pensive freedom to be real in each other\'s company, away from their lives in America.', 'Drama', 'Romance', '', 'a2GlnBzVpR0', '/wkSzJs7oMf8MIr9CQVICsvRfwA7.jpg', 1, ' ', '/yWzy9SWgQBwTm4Nc7akd9sJ1lfJ.jpg', '/45He7gApNQyDbqCDjxew9BnHzjf.jpg', '102', 7.393),
(1137, 1, 'Lost Bullet', 'tt10456740', '706503', 1, '', 'Hollywood', '2020', 'A small time delinquent, turned police mechanic for a go fast task force, is forced to defend his innocence when his mentor is killed by dirty cops.', 'Action', 'Thriller', 'Crime', '-qaYywvAyz8', '/qnlChF8U4diiykXQYs1miigGy7t.jpg', 1, ' ', '/t4mzypFVjY6toyBXAmfrIaWcUXa.jpg', '/t4mzypFVjY6toyBXAmfrIaWcUXa.jpg', '92', 6.6),
(1138, 1, 'Lost in the Pacific', 'tt4363250', '398792', 1, '?', 'Hollywood', '2016', 'The passengers of a luxury airliner become stranded on a remote, mysterious island after an emergency landing. They soon realize the island holds a dark, deadly secret.', 'Adventure', 'Science Fiction', 'Thriller', 'BsH0Bh80Yjg', '/tegfhjfMKuZrs3WhHR1hiluvMiA.jpg', 1, ' ', '/wtYF6BtUr0vErDlluf8eiq4hQ21.jpg', '/46r6CmnnvyD4zL25sfrbKbr9wyB.jpg', '86', 4.4),
(1139, 1, 'Submarine', 'tt1440292', '49020', 1, '', 'Hollywood', '2011', '15-year-old deep-thinking Welsh schoolboy Oliver Tate struggles to initiate and maintain a relationship with Jordana, his devilish, dark-haired classmate at their Swansea high school. As his parents\' marriage begins to fall apart, similar problems arise in his relationship with Jordana.', 'Drama', 'Comedy', 'Romance', 'UvgrHhM2weg', '/nbzXX3CYtKUBrPeMcG7PVoLQHXB.jpg', 1, ' ', '/rzy12BNlags49s3UoUuDEfv2h5P.jpg', '/rzy12BNlags49s3UoUuDEfv2h5P.jpg', '97', 7.397),
(1140, 1, 'Il Mare', 'tt0282599', '12650', 1, '', 'Hollywood', '2000', 'In the year 1999, a young woman leaves her quaint seaside house and returns to the city, leaving in the mailbox a card for the next owner, with instructions to forward any mail of hers to the new address. In the year 1997, a jaded young architect moves into the same house--and finds the letter. His reply, which he slips into the mailbox, finds its way to her, beginning a parallel-time love story separated by a span of two years.', 'Fantasy', 'Drama', 'Romance', 'qt3iK9XwKiE', '/csJ2BCbQaaNL4n8dk3W91QiAWmV.jpg', 1, ' ', '/vd3jQVFeFo8pFlhKlZdHWyqmB4K.jpg', '/vd3jQVFeFo8pFlhKlZdHWyqmB4K.jpg', '105', 7.5),
(1141, 1, 'Arrival', 'tt2543164', '329865', 1, '', 'Hollywood', '2016', 'Taking place after alien crafts land around the world, an expert linguist is recruited by the military to determine whether they come in peace or are a threat.', 'Drama', 'Science Fiction', 'Mystery', 'PkYh9e-fvbA', '/x2FJsf1ElAgr63Y3PNPtJrcmpoe.jpg', 1, ' ', '/1R6jjWgNFRRDEdeFtGs8JpR22BL.jpg', '/iTyh3hqTUjiRqQo8Uz1w1KtQti9.jpg', '116', 7.592);
