(1142, 1, 'Back to the Future', 'tt0088763', '105', 1, '?', 'Hollywood', '1985', 'Eighties teenager Marty McFly is accidentally sent back in time to 1955, inadvertently disrupting his parents\' first meeting and attracting his mother\'s romantic interest. Marty must repair the damage to history by rekindling his parents\' romance and - with the help of his eccentric inventor friend Doc Brown - return to 1985.', 'Adventure', 'Comedy', 'Science Fiction', 'ylDpYXyrUvc', '/fNOH9f1aA7XRTzl1sAOx9iF553Q.jpg', 1, ' ', '/4rPDCsbZBGD8l9rBflmJt42NleV.jpg', '/3lbTiIN8cVonMUQwaeh5nvn61lr.jpg', '116', 8.313),
(1143, 1, 'Back to the Future Part II', 'tt0096874', '165', 1, '', 'Hollywood', '1989', 'Marty and Doc are at it again in this wacky sequel to the 1985 blockbuster as the time-traveling duo head to 2015 to nip some McFly family woes in the bud. But things go awry thanks to bully Biff Tannen and a pesky sports almanac. In a last-ditch attempt to set things straight, Marty finds himself bound for 1955 and face to face with his teenage parents -- again.', 'Adventure', 'Comedy', 'Science Fiction', 'Hs3xcv-XoWY', '/hQq8xZe5uLjFzSBt4LanNP7SQjl.jpg', 1, ' ', '/hJu7hKfhKQDv2bxct0kjEAUWLHL.jpg', '/su0cmtK55eKXq0QjW68LQslUhUY.jpg', '108', 7.753),
(1144, 1, 'Back to the Future Part III', 'tt0099088', '196', 1, '', 'Hollywood', '1990', 'The final installment of the Back to the Future trilogy finds Marty digging the trusty DeLorean out of a mineshaft and looking for Doc in the Wild West of 1885. But when their time machine breaks down, the travelers are stranded in a land of spurs. More problems arise when Doc falls for pretty schoolteacher Clara Clayton, and Marty tangles with Buford Tannen.', 'Adventure', 'Comedy', 'Science Fiction', 'gJvz049QCvk', '/crzoVQnMzIrRfHtQw0tLBirNfVg.jpg', 1, ' ', '/dwvpUfoCB9NMoVedQQBhyaOqoSq.jpg', '/vKp3NvqBkcjHkCHSGi6EbcP7g4J.jpg', '119', 7.466),
(1145, 1, 'The 355', 'tt8356942', '522016', 1, '', 'Hollywood', '2022', 'A group of top female agents from American, British, Chinese, Colombian, and German government agencies are drawn together to try and stop an organization from acquiring a deadly weapon to send the world into chaos.', 'Action', 'Thriller', '', 'L_P16BWh3Mw', '/k26FYPVrLRHYnv5ZbMsIHFsjdIM.jpg', 1, ' ', '/svukqBZeymr5V1htWeGsfY87tiy.jpg', '/dEE5tjmrxf4xrKrTnyghLsPSt6f.jpg', '122', 6.11),
(1146, 1, 'The Hitman\'s Bodyguard', 'tt1959563', '390043', 1, 'R', 'Hollywood', '2017', 'The world’s top bodyguard gets a new client, a hitman who must testify at the International Court of Justice. They must put their differences aside and work together to make it to the trial on time.', 'Action', 'Comedy', '', '1vGQB_ebQ9o', '/5CGjlz2vyBhW5xHW4eNOZIdgzYq.jpg', 1, ' ', '/oky4nWA2rXUwJ5ChodIZh32LB31.jpg', '/7KsqfXDECZMryX1Rv4RKsT7SIjQ.jpg', '118', 6.893),
(1147, 1, 'Hitman\'s Wife\'s Bodyguard', 'tt8385148', '522931', 1, '', 'Hollywood', '2021', 'The world’s most lethal odd couple – bodyguard Michael Bryce and hitman Darius Kincaid – are back on another life-threatening mission. Still unlicensed and under scrutiny, Bryce is forced into action by Darius\'s even more volatile wife, the infamous international con artist Sonia Kincaid. As Bryce is driven over the edge by his two most dangerous protectees, the trio get in over their heads in a global plot and soon find that they are all that stand between Europe and a vengeful and powerful madman.', 'Action', 'Comedy', 'Crime', 'Qcyywmf_g6g', '/6zwGWDpY8Zu0L6W4SYWERBR8Msw.jpg', 1, ' ', '/nkiWymkJMpbCceL59vJHWJTFUln.jpg', '/cmquA5exHGsOfcVDrwitAN1EDmN.jpg', '117', 6.717),
(1148, 1, 'Ava', 'tt8784956', '539885', 1, '', 'Hollywood', '2020', 'A black ops assassin is forced to fight for her own survival after a job goes dangerously wrong.', 'Action', 'Thriller', 'Crime', 'ozUuAcGOhPs', '/qzA87Wf4jo1h8JMk9GilyIYvwsA.jpg', 1, ' ', '/iy1VXdfXlMSkzpSd6sQ3Zm6HLSH.jpg', '/il9nvQH3f92n5bBKJfpjfaHXFYi.jpg', '96', 5.799),
(1149, 1, 'Dirty Grandpa', 'tt1860213', '291870', 1, '', 'Hollywood', '2016', 'Jason Kelly is one week away from marrying his boss\'s uber-controlling daughter, putting him on the fast track for a partnership at the law firm. However, when the straight-laced Jason is tricked into driving his foul-mouthed grandfather, Dick, to Daytona for spring break, his pending nuptials are suddenly in jeopardy. Between riotous frat parties, bar fights, and an epic night of karaoke, Dick is on a quest to live his life to the fullest and bring Jason along for the ride.', 'Comedy', '', '', 'eBBCv-oSmI4', '/dETlaFOsefoeZqtgAsF5eiB3OiG.jpg', 1, ' ', '/yfXYte5ASR8g4UYwhwFxKarbeqR.jpg', '/yUjc0QIKJe0kyzjQ7Ky6dKRasv1.jpg', '102', 5.923),
(1150, 1, 'Scott Pilgrim vs. the World', 'tt0446029', '22538', 1, '', 'Hollywood', '2010', 'As bass guitarist for a garage-rock band, Scott Pilgrim has never had trouble getting a girlfriend; usually, the problem is getting rid of them. But when Ramona Flowers skates into his heart, he finds she has the most troublesome baggage of all: an army of ex-boyfriends who will stop at nothing to eliminate him from her list of suitors.', 'Action', 'Comedy', 'Romance', 'TVaIEZN3LFE', '/g5IoYeudx9XBEfwNL0fHvSckLBz.jpg', 1, ' ', '/AXcwoWW7gqRdG0DFsVAAuqSxVD.jpg', '/7W9xm2YTq54rfLFimIniMrywShv.jpg', '113', 7.482),
(1151, 1, 'It Follows', 'tt3235888', '270303', 1, '', 'Hollywood', '2015', 'When carefree teenager Jay sleeps with her older boyfriend for the first time, she learns that she is the latest recipient of a fatal curse that is passed from victim to victim via sexual intercourse. Death, Jay learns, will creep inexorably toward her as either a friend or a stranger. Jay\'s friends don\'t believe her seemingly paranoid ravings, until they too begin to see the phantom assassins and band together to help her defend herself.', 'Horror', 'Mystery', '', 'VEGWioWrR-g', '/iwnQ1JH1wdWrGYkgWySptJ5284A.jpg', 1, ' ', '/1mfFOgBTo3TsAVkRgLop0fdLQRO.jpg', '/ht9ZZXEkkMrBC9Biea5fstvD9v6.jpg', '101', 6.567),
(1152, 1, 'Mike and Dave Need Wedding Dates', 'tt2823054', '316023', 1, '', 'Hollywood', '2016', 'Mike and Dave are young, adventurous, fun-loving brothers who tend to get out of control at family gatherings. When their sister Jeanie reveals her Hawaiian wedding plans, the rest of the Stangles insist that the brothers bring respectable dates. After placing an ad on Craigslist, the siblings decide to pick Tatiana and Alice, two charming and seemingly normal women. Once they arrive on the island, however, Mike and Dave realize that their companions are ready to get wild and party.', 'Comedy', '', '', 'Z6ovonZxNk8', '/rK0UwpiE3PSdGahfDZLCummxMwd.jpg', 1, ' ', '/r7fubpXPjenKYlNRjvCslAAAIOX.jpg', '/4lfP1eVs5Q3Gk0K2kn1RvWs5alH.jpg', '98', 6.1),
(1153, 1, 'It\'s in the Blood', 'tt2072134', '131673', 1, '', 'Hollywood', '2012', 'One year after a tragic incident tore their family apart, a grieving son and his estranged father embark on a journey into the wild to reconcile their past. When a horrifying accident leaves Russell badly injured, and strands them in the wild, it is up to October to save them both. However, this wilderness is not what it seems, and as they deteriorate, so to does their concept of reality.', 'Horror', 'Thriller', 'Drama', 'ZSg_WtRTRjU', '/vTcW5yE75HgdasM0XP0TjlG90MF.jpg', 1, ' ', '/iOwRRNAPMq4TDPDJzwbfEdOndKC.jpg', '/iOwRRNAPMq4TDPDJzwbfEdOndKC.jpg', '81', 4.8),
