(1240, 1, 'Extraction', 'tt8936646', '545609', 1, '', 'Hollywood', '2020', 'Tyler Rake, a fearless mercenary who offers his services on the black market, embarks on a dangerous mission when he is hired to rescue the kidnapped son of a Mumbai crime lord.', 'Action', 'Thriller', '', 'xso-ELEIlss', '/nygOUcBKPHFTbxsYRFZVePqgPK6.jpg', 1, ' ', '/dkpbxcTDUHygJI3xpqrpS5OJJ8M.jpg', '/1R6cvRtZgsYCkh8UFuWFN33xBP4.jpg', '116', 7.349),
(1241, 1, 'Isi & Ossi', 'tt9806322', '658760', 1, '?', 'Hollywood', '2020', 'Isi and Ossi couldn\'t be any more different: She\'s a billionaire\'s daughter from Heidelberg, he\'s a struggling boxer from the nearby town of Mannheim. But when Isi meets Ossi, the two quickly realize that they can take advantage of one another: She dates the broke boxer to provoke her parents and get them to fund a long-desired chef training in New York. He tries to rip off the rich daughter to finance his first professional boxing match. Their plans soon develop into emotional chaos that challenges everything the two believe to know about money, career and love.', 'Romance', 'Comedy', '', 'oHwqCm23s_8', '/bZ7H0kCwEM6CQ0dyCs2H4RkU130.jpg', 1, ' ', '/2EOy2YSJbzKvlzKpEEKULVYZGlN.jpg', '/2EOy2YSJbzKvlzKpEEKULVYZGlN.jpg', '113', 6.947),
