(1244, 1, 'Ella Enchanted', 'tt0327679', '14442', 1, '', 'Hollywood', '2004', 'Ella lives in a magical world in which each child, at the moment of their birth, is given a virtuous \"gift\" from a fairy godmother. Ella\'s so-called gift, however, is obedience. This birthright proves itself to be quite the curse once Ella finds herself in the hands of several unscrupulous characters whom she quite literally cannot disobey. Determined to gain control of her life and decisions, Ella sets off on a journey to find her fairy godmother who she hopes will lift the curse. The path, however, isn\'t easy -- Ella must outwit a slew of unpleasant obstacles including ogres, giants, wicked stepsisters, elves and Prince Charmont\'s evil uncle, who wants to take over the crown and rule the kingdom.', 'Family', 'Fantasy', 'Comedy', 'OoSUHgs7hCs', '/dH8yHmqUra0gqzMJJKXiyfKkB57.jpg', 1, ' ', '/35XwdtZktTzrOZxyGdAhGj0aiK1.jpg', '/qGjl2b8lw1YjSOuQ6NpVVW9Ddz0.jpg', '96', 6.444),
