(1249, 1, 'The Edge of Love', 'tt0819714', '14061', 1, '', 'Hollywood', '2008', 'When the Welsh poet Dylan Thomas and his flirtatious wife Caitlin sweep into war-torn London, the last thing they expect is to bump into Dylan\'s childhood sweetheart Vera. Despite her joy at seeing Dylan after so many years, Vera is swept off her feet by a dashing officer, William Killick, and finds herself torn between the open adoration of her new found beau and the wily charms of the exotic Welshman.', 'Drama', 'History', 'Romance', '8fNabjyaKUo', '/uo7ZDvipL2OZu6G44hDP0sjDZ9n.jpg', 1, ' ', '/fiRxDoAHRLko3ycPtw1EeWaKxTQ.jpg', '/fiRxDoAHRLko3ycPtw1EeWaKxTQ.jpg', '110', 6.2),
(1250, 1, 'Priest', 'tt0822847', '38321', 1, '', 'Hollywood', '2011', 'In an alternate world, humanity and vampires have warred for centuries. After the last Vampire War, the veteran Warrior Priest lives in obscurity with other humans inside one of the Church\'s walled cities. When the Priest\'s niece is kidnapped by vampires, the Priest breaks his vows to hunt them down. He is accompanied by the niece\'s boyfriend, who is a wasteland sheriff, and a former Warrior Priestess.', 'Action', 'Fantasy', 'Horror', 'hinWQiv2rVc', '/fYHiA7LPGl9DG7m3DUs0Td1VMcO.jpg', 1, ' ', '/4e5NEAvfXWqY9yPsvyReQbRF2e.jpg', '/20tn2zs67BrZ9K618dTNMxhCOra.jpg', '87', 5.768),
