(1314, 1, 'A Bronx Tale', 'tt0106489', '1607', 1, '', 'Hollywood', '1993', 'Set in the Bronx during the tumultuous 1960s, an adolescent boy is torn between his honest, working-class father and a violent yet charismatic crime boss. Complicating matters is the youngster\'s growing attraction - forbidden in his neighborhood - for a beautiful black girl.', 'Drama', 'Crime', '', 'q5nQyoo1LwY', '/sDbO6LmLYtyqAoFTPpRcMgPSCEO.jpg', 1, ' ', '/e6OMPqWNKY02l9N8zh2hIV4qj4i.jpg', '/j5VUdrnRBya3KE40t0ucAN2YqDs.jpg', '121', 7.853),
