(1322, 1, 'Million Dollar Baby', 'tt0405159', '70', 1, '', 'Hollywood', '2004', 'Despondent over a painful estrangement from his daughter, trainer Frankie Dunn isn\'t prepared for boxer Maggie Fitzgerald to enter his life. But Maggie\'s determined to go pro and to convince Dunn and his cohort to help her.', 'Drama', '', '', '5_RsHRmIRBY', '/2ti3l1OeB8G94yyqfAI7nmMZUbA.jpg', 1, ' ', '/efXetskp2hnswIIYHFXaHS0UlME.jpg', '/oGMomeS7bE43eN8SGJUaKvQnmud.jpg', '132', 7.956),
(1323, 1, 'Amores Perros', 'tt0245712', '55', 1, '', 'Hollywood', '2000', 'A fatalistic car crash in Mexico city sets off a chain of events in the lives of three people: a supermodel, a young man wanting to run off with his sister-in-law, and a homeless man. Their lives are catapulted into unforeseen situations instigated by the seemingly inconsequential destiny of a dog.', 'Drama', 'Thriller', '', 'y8T20__amek', '/vV4vlD4ool5JSsS1rB82qjCF6z8.jpg', 1, ' ', '/qNQOEzm6xJ2hgWDImzkIox27aiV.jpg', '/qNQOEzm6xJ2hgWDImzkIox27aiV.jpg', '154', 7.628),
(1324, 1, 'Schindler\'s List', 'tt0108052', '424', 1, '', 'Hollywood', '1993', 'The true story of how businessman Oskar Schindler saved over a thousand Jewish lives from the Nazis while they worked as slaves in his factory during World War II.', 'Drama', 'History', 'War', 'lx9Ahsr4544', '/sF1U4EUQS8YHUYjNl3pMGNIQyr0.jpg', 1, ' ', '/wH7ZxjF1yU3azuj3pgXVcgrCTUk.jpg', '/3f92DMBTFqr3wgXpfxzrb0qv8nG.jpg', '195', 8.573),
(1325, 1, 'Into the Wild', 'tt0758758', '5915', 1, '', 'Hollywood', '2007', 'After graduating from Emory University in 1992, top student and athlete Christopher McCandless abandons his possessions, gives his entire $24,000 savings account to charity, and hitchhikes to Alaska to live in the wilderness.', 'Adventure', 'Drama', '', 'g7ArZ7VD-QQ', '/2MSGZEE6XZd2r4ODNziwAw7Hpw0.jpg', 1, ' ', '/w8Br5nwFRgjfYdFqhxUpU9XuC0H.jpg', '/mvyERNa0oNsBjbHqn5qSGMHk2FM.jpg', '148', 7.808),
(1326, 1, 'Once Upon a Time in America', 'tt0087843', '311', 1, '', 'Hollywood', '1984', 'A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.', 'Drama', 'Crime', '', 'lFw062jAYR0', '/i0enkzsL5dPeneWnjl1fCWm6L7k.jpg', 1, ' ', '/wxoxxA9oINGVI4vJWYnDId6oRMv.jpg', '/uPYa165sraN2c8gZBM9C47g3JoU.jpg', '229', 8.427),
(1327, 1, 'Aftersun', 'tt19770238', '965150', 1, '', 'Hollywood', '2022', 'Sophie reflects on the shared joy and private melancholy of a holiday she took with her father twenty years earlier. Memories real and imagined fill the gaps between miniDV footage as she tries to reconcile the father she knew with the man she didn\'t.', 'Drama', '', '', '61U8XMRPVY8', '/evKz85EKouVbIr51zy5fOtpNRPg.jpg', 1, ' ', '/6zDioXV47d2qmi8RN1Hf9oikens.jpg', '/d5l2ITQvpgP0dcWCAG6PUvp8YZw.jpg', '102', 7.7),
(1328, 1, 'Never Let Me Go', 'tt1334260', '42188', 1, '', 'Hollywood', '2010', 'As children, Kathy, Ruth, and Tommy spend their childhood at an idyllic and secluded English boarding school. As they grow into adults, they must come to terms with the complexity and strength of their love for one another while also preparing for the haunting reality awaiting them.', 'Drama', 'Romance', 'Science Fiction', 'sXiRZhDEo8A', '/8F0r5ng9Fp60OhzQfR5v33fppq.jpg', 1, ' ', '/evertqAnBGZOX6hELDLc2NLVV5E.jpg', '/ppf18IfACeWmkObqyjrhmNiL6G4.jpg', '104', 6.856),
(1329, 1, 'Never Let Go', 'tt3833474', '347761', 1, '', 'Hollywood', '2015', 'Former FBI agent, now single mother Lisa Brennan, takes a holiday to escape an unhappy love affair and painful family memories. But in a heartbeat, she is not only faced with a daughter kidnapped by human traffickers, but also faces murder charges and must keep one step ahead of the foreign police.', 'Drama', 'Action', 'Thriller', 'zBlPHzjLiCE', '/j0jBuB28AAf9EeFgcictYRv7N5Z.jpg', 1, ' ', '/5IwgP2b3n4LgRNjBrwRie2rdiHO.jpg', '/qEczZoDvMhwoz1h8siYlKTosWik.jpg', '93', 5.6),
(1330, 1, 'World War Z', 'tt0816711', '72190', 1, '', 'Hollywood', '2013', 'Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.', 'Action', 'Drama', 'Horror', 'TvRCQM2HrXs', '/1SWBSYJsnyhdNRfLI1T6RsCxAQ4.jpg', 1, ' ', '/kIKKwaw4TPcfRlBH5e0HueyybGo.jpg', '/kg2FOT2Oe5PSCgs3L4vLel6B7ck.jpg', '116', 6.81),
