(1333, 1, 'Ford v Ferrari', 'tt1950186', '359724', 1, '', 'Hollywood', '2019', 'American car designer Carroll Shelby and the British-born driver Ken Miles work together to battle corporate interference, the laws of physics, and their own personal demons to build a revolutionary race car for Ford Motor Company and take on the dominating race cars of Enzo Ferrari at the 24 Hours of Le Mans in France in 1966.', 'Drama', 'Action', 'History', 'DWu1OnpXFiQ', '/dR1Ju50iudrOh3YgfwkAU1g2HZe.jpg', 1, ' ', '/jy1Q0sKQGNaSfNqAkvE6DCAfdKz.jpg', '/ydmZIafp66mHABs3QJDwvjRgZfE.jpg', '153', 8),
(1334, 1, 'The Aviator', 'tt0338751', '2567', 1, '', 'Hollywood', '2004', 'A biopic depicting the life of filmmaker and aviation pioneer Howard Hughes from 1927 to 1947, during which time he became a successful film producer and an aviation magnate, while simultaneously growing more unstable due to severe obsessive-compulsive disorder.', 'Drama', '', '', 'ewBaj0A0YLM', '/lx4kWcZc3o9PaNxlQpEJZM17XUI.jpg', 1, ' ', '/smCxORGf5kKMeI2WI42PHJXrPWj.jpg', '/wNBLjvDpvTS3wyOZCecf3Jas7la.jpg', '170', 7.228),
(1335, 1, 'Hidden Figures', 'tt4846340', '381284', 1, '', 'Hollywood', '2016', 'The untold story of Katherine G. Johnson, Dorothy Vaughan and Mary Jackson – brilliant African-American women working at NASA and serving as the brains behind one of the greatest operations in history – the launch of astronaut John Glenn into orbit. The visionary trio crossed all gender and race lines to inspire generations to dream big.', 'Drama', 'History', '', 'W1VZ1-ZdQ7k', '/9lfz2W2uGjyow3am00rsPJ8iOyq.jpg', 1, ' ', '/sNo3N7wTmdtEP7oAWxHe0mJNGJW.jpg', '/rfkIeCaIHhN3K5wjJJqKmfUjYp8.jpg', '127', 8.058),
