(1337, 1, 'Come and See', 'tt0091251', '25237', 1, '', 'Hollywood', '1985', 'The invasion of a village in Byelorussia by German forces sends young Florya into the forest to join the weary Resistance fighters, against his family\'s wishes. There he meets a girl, Glasha, who accompanies him back to his village. On returning home, Florya finds his family and fellow peasants massacred. His continued survival amidst the brutal debris of war becomes increasingly nightmarish, a battle between despair and hope.', 'Drama', 'War', '', 'QHqtBZVUsxo', '/qNbMsKVzigERgJUbwf8pKyZogpb.jpg', 1, ' ', '/5CTseLTxpOBYHA8b3l4sZhjkOqO.jpg', '/6C1U0cKK5zGjyUSwNc5GLSVCr7Y.jpg', '142', 8.288),
(1338, 1, 'Superbad', 'tt0829482', '8363', 1, 'R', 'Hollywood', '2007', 'Two co-dependent high school seniors are forced to deal with separation anxiety after their plan to stage a booze-soaked party goes awry.', 'Comedy', '', '', 'LvKvus3vCEY', '/ek8e8txUyUwd2BNqj6lFEerJfbq.jpg', 1, ' ', '/d5BP41uK68d9Yd5RZBIT4S8C7qz.jpg', '/giYuvpmpZbwkT3NtX4WdNYqGhxw.jpg', '113', 7.235);
