(1339, 1, 'Return to Dust', 'tt17097088', '928720', 1, '', 'Hollywood', '2022', 'Humble, unassuming Ma and timid Cao have been cast off by their families and forced into an arranged marriage. They have to combine their strength and build a home to survive. In the face of much adversity, an unexpected bond begins to blossom, as both Ma and Cao, uniting with Earth\'s cycles, create a haven for themselves in which they can thrive.', 'Drama', 'Romance', '', 'cxRQRlIoXsM', '/aRrbuzkG2lToSEgz7j9fXV5C7ka.jpg', 1, ' ', '/7EvBCDalYbDrzp9a69kCUYlszlw.jpg', '/7EvBCDalYbDrzp9a69kCUYlszlw.jpg', '133', 7.2),
(1340, 1, 'Gardens of the Night', 'tt0833960', '16867', 1, '', 'Hollywood', '2008', 'After being abducted as children, and suffering years of abuse, a teenage boy and girl find themselves living on the street.', 'Crime', 'Drama', '', 'y710WJF-Vus', '/nEDnI0GwPoe9hLSQkmQ7jbCftI8.jpg', 1, ' ', '/khNT4HVFPcFiMhOOWipwkW18dXf.jpg', '/khNT4HVFPcFiMhOOWipwkW18dXf.jpg', '110', 6.164),
(1341, 1, 'Capernaum', 'tt8267604', '517814', 1, '', 'Hollywood', '2018', 'Zain, a 12-year-old boy scrambling to survive on the streets of Beirut, sues his parents for having brought him into such an unjust world, where being a refugee with no documents means that your rights can easily be denied.', 'Drama', '', '', 'HlSI7gKvAGo', '/mFnfTVADj8yOxwzprYOmTPselk8.jpg', 1, ' ', '/1p6cMqrxwLjTHmruMCWfpbTAxvt.jpg', '/1p6cMqrxwLjTHmruMCWfpbTAxvt.jpg', '126', 8.175),
(1342, 1, 'The Hours', 'tt0274558', '590', 1, '', 'Hollywood', '2002', '\"The Hours\" is the story of three women searching for more potent, meaningful lives. Each is alive at a different time and place, all are linked by their yearnings and their fears. Their stories intertwine, and finally come together in a surprising, transcendent moment of shared recognition.', 'Drama', '', '', 'CkPWXUxIiXs', '/4myDtowDJQPQnkEDB1IWGtJR1Fo.jpg', 1, ' ', '/mXrmW5tK8EivU7p4zrX79VSX2xs.jpg', '/eSGa8LWATrc983PYFjGSIuMsNt6.jpg', '114', 7.286),
(1343, 1, 'Colette', 'tt5437928', '454652', 1, '', 'Hollywood', '2018', 'After marrying a successful Parisian writer known commonly as Willy, Sidonie-Gabrielle Colette is transplanted from her childhood home in rural France to the intellectual and artistic splendor of Paris. Soon after, Willy convinces Colette to ghostwrite for him. She pens a semi-autobiographical novel about a witty and brazen country girl named Claudine, sparking a bestseller and a cultural sensation. After its success, Colette and Willy become the talk of Paris and their adventures inspire additional Claudine novels.', 'Drama', 'History', '', 'X5YiphzraCw', '/z73Wer1DgObAwWnqZlOyeI33ROY.jpg', 1, ' ', '/jyhL6LVX6NaQvRCZHIh6KjI7Jsk.jpg', '/um7DVcGyLvImgAdn5JGpjIudYSV.jpg', '112', 6.937),
(1344, 1, 'A Single Man', 'tt1315981', '34653', 1, '', 'Hollywood', '2009', 'The life of George Falconer, a British college professor, is reeling with the recent and sudden loss of his longtime partner. This traumatic event makes George challenge his own will to live as he seeks the console of his close girl friend Charley, who is struggling with her own questions about life.', 'Drama', 'Romance', '', 'KTQT6hGp96g', '/vhoM2LmcPlzcgBIztqqsSAYwaF7.jpg', 1, ' ', '/4rHZyoFxGxvkMNiLFEqwm19HCtc.jpg', '/4rHZyoFxGxvkMNiLFEqwm19HCtc.jpg', '97', 7.3),
(1345, 1, 'Detachment', 'tt1683526', '74308', 1, '', 'Hollywood', '2011', 'A chronicle of three weeks in the lives of several high school teachers, administrators and students through the eyes of substitute teacher, Henry Barthes. Henry roams from school to school, imparting modes of knowledge, but never staying long enough to form any semblance of sentient attachment.', 'Drama', '', '', 'KXLa3swAa8Y', '/5NYI1dfskJ8oKEbVgJlJE4txnZ2.jpg', 1, ' ', '/ypWuu5WUzJ9RLXF1LKYGWqr6Hmx.jpg', '/frYaBZwQlmYNrulugOmtOEh9d6H.jpg', '98', 7.623),
(1346, 1, 'The Lovely Bones', 'tt0380510', '7980', 1, '', 'Hollywood', '2009', 'After being brutally murdered, 14-year-old Susie Salmon watches from heaven over her grief-stricken family -- and her killer. As she observes their daily lives, she must balance her thirst for revenge with her desire for her family to heal.', 'Fantasy', 'Drama', '', 'QydPyttFzhs', '/sn0iDphRxQ7I6aLd9igIgACITak.jpg', 1, ' ', '/kKCb86mklYuazFLNe8IFHzNn1w9.jpg', '/sgYKZjHkT7AXvFKXqQ9AnAmXIOn.jpg', '136', 7.075),
(1347, 1, 'Stuart: A Life Backwards', 'tt0853153', '50032', 1, '', 'Hollywood', '2007', 'Story about the remarkable friendship between a reclusive writer and illustrator and a chaotic homeless man, whom he gets to know during a campaign to release two charity workers from prison.', 'Drama', '', '', 'lxlJaYHwIhU', '/yNqCMTi0J3LHDVklJpUAwWiQ8G3.jpg', 1, ' ', '/JZ73zv3on5wJkA5z0OetOAn9tt.jpg', '/JZ73zv3on5wJkA5z0OetOAn9tt.jpg', '92', 7.446),
(1348, 1, 'Sophie\'s Choice', 'tt0084707', '15764', 1, '', 'Hollywood', '1982', 'Stingo, a young writer, moves to Brooklyn in 1947 to begin work on his first novel. As he becomes friendly with Sophie and her lover Nathan, he learns that she is a Holocaust survivor. Flashbacks reveal her harrowing story, from pre-war prosperity to Auschwitz. In the present, Sophie and Nathan\'s relationship increasingly unravels as Stingo grows closer to Sophie and Nathan\'s fragile mental state becomes ever more apparent.', 'Drama', 'Romance', 'War', 'eLtcAHpl1Fg', '/6zayvLCWvF8ImK5UqwRUbETcpVU.jpg', 1, ' ', '/rL5zcd7DJFfNmp4o0a8h0Jxeumd.jpg', '/xczDgm9F3uN3PqyP5yvs3JI9HrJ.jpg', '151', 7.3),
