(1350, 1, 'Bound by Honor', 'tt0106469', '9702', 1, '', 'Hollywood', '1993', 'Based on the true life experiences of poet Jimmy Santiago Baca, the film focuses on half-brothers Paco and Cruz, and their bi-racial cousin Miklo. It opens in 1972, as the three are members of an East L.A. gang known as the \"Vatos Locos\", and the story focuses on how a violent crime and the influence of narcotics alter their lives. Miklo is incarcerated and sent to San Quentin, where he makes a \"home\" for himself. Cruz becomes an exceptional artist, but a heroin addiction overcomes him with tragic results. Paco becomes a cop and an enemy to his \"carnal\", Miklo.', 'Crime', 'Action', 'Drama', 'NMj89zgI8Yc', '/gvP6R6juhe2IpCG7QGDgjyUvm0g.jpg', 1, ' ', '/30PZ5gIsUyBucNG8v4QwJDaieSi.jpg', '/ksdencRboJK5L17GFfRJ0UnLVVh.jpg', '190', 8.111),
(1351, 1, 'Howl', 'tt2393827', '301846', 1, '', 'Hollywood', '2015', 'When passengers on a train are attacked by a creature, they must band together in order to survive until morning.', 'Horror', '', '', 'FFmUBiMIBVs', '/XcwP3VGTRVHjc4doNP8w1fdOJ7.jpg', 1, ' ', '/8FyeqAq4dZ5mxvfC1SZJdVfBJDz.jpg', '/8FyeqAq4dZ5mxvfC1SZJdVfBJDz.jpg', '89', 5.5),
