(1553, 1, 'The Maze Runner', 'tt1790864', '198663', 1, 'PG-13', 'Hollywood', '2014', 'Set in a post-apocalyptic world, young Thomas is deposited in a community of boys after his memory is erased, soon learning they\'re all trapped in a maze that will require him to join forces with fellow “runners” for a shot at escape.', 'Action', 'Mystery', 'Science Fiction', '3b946aGm0zs', '/ode14q7WtDugFDp78fo9lCsmay9.jpg', 1, ' ', '/iPRIipGKdiVS8vViA2qcv0PerU.jpg', '/vHJlbhsXrZ5yrO2KqCbGSIU6fRX.jpg', '113', 7.175),
(1554, 1, 'Maze Runner: The Death Cure', 'tt4500922', '336843', 1, 'PG-13', 'Hollywood', '2018', 'Thomas leads his group of escaped Gladers on their final and most dangerous mission yet. To save their friends, they must break into the legendary Last City, a WCKD-controlled labyrinth that may turn out to be the deadliest maze of all. Anyone who makes it out alive will get answers to the questions the Gladers have been asking since they first arrived in the maze.', 'Science Fiction', 'Action', 'Adventure', 'Th0Tlj8XL1A', '/2zYfzA3TBwrMC8tfFbpiTLODde0.jpg', 1, ' ', '/q84eXDrgXxb2p1tZpZl2RNKq4Cd.jpg', '/zgcL0xaHxXVvrV1Fu1ZSKoTk0MH.jpg', '143', 7.108),
(1555, 1, 'Lucy', 'tt2872732', '240832', 1, 'R', 'Hollywood', '2014', 'A woman, accidentally caught in a dark deal, turns the tables on her captors and transforms into a merciless warrior evolved beyond human logic.', 'Action', 'Science Fiction', '', 'l7zAV_MDC68', '/dhjyfcwEoW6jJ4Q7DpZTp6E58GA.jpg', 1, ' ', '/djvT4EHxidT637UrDTQxshAFqd8.jpg', '/ozVwXlfxqNsariipatGwa5px3Pm.jpg', '89', 6.445),
(1556, 1, 'I Am Number Four', 'tt1464540', '46529', 1, 'PG-13', 'Hollywood', '2011', 'A teenage fugitive with an incredible secret races to stay one step ahead of the mysterious forces seeking destroy him in this sci-fi action thriller. With three dead and one on the run, the race to find the elusive Number Four begins. Outwardly normal teen John Smith never gets too comfortable in the same identity, and along with his guardian, Henri, he is constantly moving from town to town. With each passing day, John gains a stronger grasp on his extraordinary new powers, and his bond to the beings that share his fantastic fate grows stronger.', 'Action', 'Thriller', 'Science Fiction', 'XR2QSlHpKg4', '/973sCL0OjAk2Igq46SDwhyDFv3n.jpg', 1, ' ', '/h1RcaWTmJ81HV6MQNTqa0a0nZDG.jpg', '/AnA7leKuH68mwHCf7beWjp6GSqm.jpg', '109', 6.174),
(1557, 1, 'The Darkest Minds', 'tt4073790', '445651', 1, 'PG-13', 'Hollywood', '2018', 'After a disease kills 98% of America\'s children, the surviving 2% develop superpowers and are placed in internment camps. A 16-year-old girl escapes her camp and joins a group of other teens on the run from the government.', 'Action', 'Adventure', 'Drama', 'exMwgBL6i5c', '/3oobSYJ3Mv0hohKU5GBHarU3ZHG.jpg', 1, ' ', '/cfBD5UlPL5Ibig511XiqLUVwlsH.jpg', '/rPBeEi1tU8IhQ9rbdnlLU0d0NR.jpg', '105', 7.044),
(1558, 1, 'Midnight Special', 'tt2649554', '245703', 1, '?', 'Hollywood', '2016', 'A father and son go on the run after the dad learns his child possesses special powers.', 'Adventure', 'Drama', 'Science Fiction', 'vSEFKRHNhzE', '/hgDRq1l4ATxwufWjILKsYtglbI6.jpg', 1, ' ', '/uWHDNMk9rGBaFVqv2SxTOuBFfS0.jpg', '/akfExB9nb79hphVLd3aM64h9ZES.jpg', '112', 6.221),
(1559, 1, 'Firestarter', 'tt1798632', '532710', 1, 'R', 'Hollywood', '2022', 'For more than a decade, parents Andy and Vicky have been on the run, desperate to hide their daughter Charlie from a shadowy federal agency that wants to harness her unprecedented gift for creating fire into a weapon of mass destruction. Andy has taught Charlie how to defuse her power, which is triggered by anger or pain. But as Charlie turns 11, the fire becomes harder and harder to control. After an incident reveals the family\'s location, a mysterious operative is deployed to hunt down the family and seize Charlie once and for all. Charlie has other plans.', 'Science Fiction', 'Thriller', 'Horror', 'AFkPuI3dGKg', '/2MTGip0nfahQ1jPQCZSfCsPBZes.jpg', 1, ' ', '/mgJkZPLXc6CuC9E2Ve4XAP2naeQ.jpg', '/bIFrsAcqkLUUxaaiqqpFexYPeCh.jpg', '94', 5.64),
(1560, 1, 'Carriers', 'tt0806203', '25769', 1, 'PG-13', 'Hollywood', '2009', 'A deadly virus has spread across the globe. Contagion is everywhere, no one is safe, and no one can be trusted. Four friends race through the back roads of the American West on their way to a secluded utopian beach in the Gulf of Mexico where they could peacefully wait out the pandemic. Their plans take a grim turn when their car breaks down on an isolated road starting a chain of events that will seal their fates.', 'Action', 'Drama', 'Horror', 'IwH4bxNK8Os', '/jxjnjHtHXgvjdhkwpelE9ZwVMg6.jpg', 1, ' ', '/wcWm3B1VYKi5oXPZFeGHKcIZHvX.jpg', '/uYxAGovHS4mCGsIeSZCTtwOQ5Po.jpg', '84', 6.1),
(1561, 1, 'Project Almanac', 'tt2436386', '227719', 1, 'PG-13', 'Hollywood', '2015', 'A group of teens discover secret plans of a time machine, and construct one. However, things start to get out of control.', 'Science Fiction', 'Thriller', 'Drama', '8Yih-CxTWsw', '/r59tzuqi6AoxRKdPHzg3ZBke7aA.jpg', 1, ' ', '/1D3HWigq3jDEV9vYABpWz0AgbEO.jpg', '/eyJk5LTMLIeAN2kVsP0yXrPZJfl.jpg', '106', 6.747),
(1562, 1, 'The Signal', 'tt2910814', '242095', 1, '?', 'Hollywood', '2014', 'On a road trip, Nic and two friends are drawn to an isolated area by a computer genius. When everything suddenly goes dark, Nic regains consciousness – only to find himself in a waking nightmare.', 'Thriller', 'Science Fiction', '', 'uehQEldYkTs', '/opZNdMgVBl3kKpKlW58PXnLZKFV.jpg', 1, ' ', '/6dj9fv5tNdr8p06BnJxBMcAGb3u.jpg', '/oxZh9qhkxfOczKmTang0j9a06Bx.jpg', '97', 5.98),
(1563, 1, 'Chronicle', 'tt1706593', '76726', 1, 'PG-13', 'Hollywood', '2012', 'Three high school students make an incredible discovery, leading to their developing uncanny powers beyond their understanding. As they learn to control their abilities and use them to their advantage, their lives start to spin out of control, and their darker sides begin to take over.', 'Science Fiction', 'Drama', 'Thriller', 'AQ9XG-j4kvU', '/xENglsVIIWEEhhB5lgpy33tGcKI.jpg', 1, ' ', '/gnVj0anmHmk3S4tprHbBHXFCo5M.jpg', '/rgNzvSagnlc32TuMEBa529QFIig.jpg', '84', 6.824),
(1564, 1, 'The Gift', 'tt4178092', '328425', 1, 'R', 'Hollywood', '2015', 'Simon and Robyn are a young married couple whose life is going as planned until a chance run-in with Simon\'s high school acquaintance sends their world into a tailspin.', 'Thriller', 'Mystery', 'Drama', 'eqBoirhOrIY', '/kH3qLP8pn68Xq5XwvmPkCyaAU7W.jpg', 1, ' ', '/qRHc3vBAM0zoiCsQz1lOujJfewa.jpg', '/iKzLQg7xzMN3P9I2zE1CGaVPoC9.jpg', '108', 6.699),
(1565, 1, 'Push', 'tt0465580', '13455', 1, 'PG-13', 'Hollywood', '2009', 'After his father, an assassin, is brutally murdered, Nick Gant vows revenge on Division, the covert government agency that dabbles in psychic warfare and experimental drugs. Hiding in Hong Kong\'s underworld, Nick assembles a band of rogue psychics dedicated to destroying Division. Together with Cassie, a teenage clairvoyant, Nick goes in search of a missing girl and a stolen suitcase that could be the key to accomplishing their mutual goal.', 'Science Fiction', 'Action', 'Adventure', 'Pl3KNqCEtQ4', '/fHStfRjQGstuqtUz4Q22lbFU58M.jpg', 1, ' ', '/rFm7qBcFnV8sLmMuccHLIlPcC6Z.jpg', '/uQ5xARQz6BiKlppKCBnKmkfW76m.jpg', '111', 6.155),
(1566, 1, 'Jumper', 'tt0489099', '8247', 1, 'PG-13', 'Hollywood', '2008', 'David Rice is a man who knows no boundaries, a Jumper, born with the uncanny ability to teleport instantly to anywhere on Earth. When he discovers others like himself, David is thrust into a dangerous and bloodthirsty war while being hunted by a sinister and determined group of zealots who have sworn to destroy all Jumpers. Now, David’s extraordinary gift may be his only hope for survival!', 'Action', 'Adventure', 'Science Fiction', '3BgwRL3wOy0', '/3pPZ9JhNz3VMmASVir5SMHvTDUU.jpg', 1, ' ', '/q5vTaHWNdsgHpzyvqUVCEUfnBdn.jpg', '/fIlBSPeGnSwIxuZbqQjR0EEbaIG.jpg', '88', 6.145),
(1567, 1, 'Annie', 'tt1823664', '196867', 1, 'PG', 'Hollywood', '2014', 'Annie is a young, happy foster kid who\'s also tough enough to make her way on the streets of New York in 2014. Originally left by her parents as a baby with the promise that they\'d be back for her someday, it\'s been a hard knock life ever since with her mean foster mom Miss Hannigan. But everything\'s about to change when the hard-nosed tycoon and New York mayoral candidate Will Stacks—advised by his brilliant VP and his shrewd and scheming campaign advisor—makes a thinly-veiled campaign move and takes her in. Stacks believes he\'s her guardian angel, but Annie\'s self-assured nature and bright, sun-will-come-out-tomorrow outlook on life just might mean it\'s the other way around.', 'Comedy', 'Drama', 'Family', 'nasLuiP-1E0', '/33WsmnE5M2SSGrZCQW4dlr2D5WG.jpg', 1, ' ', '/AsfjQHmlXNOgBNDDNgHQLo7NOBN.jpg', '/cgh1gGBzCI2zh8fNyJMb21UYqv9.jpg', '119', 6.3),
(1568, 1, 'A Very Good Girl', 'tt27327494', '1105324', 1, '?', 'Hollywood', '2023', 'After a heartless firing triggers a chain of unfortunate events, Philo plots a meticulous revenge against retail mogul, Mother Molly, aiming to dismantle her empire and seize the ultimate payback. This time, there is no mercy.', 'Drama', 'Comedy', 'Thriller', 'jFfzQYNY0AE', '/ezfxB7Kd2l6keH9xBCX4599zuuL.jpg', 1, ' ', '/6oNhPD8Ss2ex3eGyil3DKj5mimA.jpg', '/6oNhPD8Ss2ex3eGyil3DKj5mimA.jpg', '117', 7),
(1569, 1, 'What Happens Later', 'tt19890316', '970948', 1, 'R', 'Hollywood', '2023', 'Two ex-lovers get snowed in at a regional airport overnight. Indefinitely delayed, Willa, a magical thinker, and Bill, a catastrophic one, find themselves just as attracted to and annoyed by one another as they did decades earlier. But as they unpack the riddle of their mutual past and compare their lives to the dreams they once shared, they begin to wonder if their reunion is mere coincidence, or something more enchanted.', 'Romance', 'Comedy', '', 'GS3DOuOUTOA', '/5TrWftAac3EeMcatyiCdAglWKb6.jpg', 1, ' ', '/po2LYaRD3WzoubRNHMPaWohKSfX.jpg', '/czbn0za9QyP5umRBikimxQ2iNm9.jpg', '104', 5.233),
(1570, 1, 'Sick Girl', 'tt3701150', '618165', 1, 'R', 'Hollywood', '2023', 'When Wren Pepper feels her closest friends slipping away, she lets loose a little white lie that snowballs into a colossal, life-altering event.', 'Comedy', '', '', '2y8ywYOVSWQ', '/oBwvNA03OQ2VXbtySYXPWRuWAGx.jpg', 1, ' ', '/d73mNQr7ZP4IleKVjhgPXlShaC3.jpg', '/mW3PFhxEF1f99MK9Ei0HCqlMyD5.jpg', '99', 5.1),
(1571, 1, 'Afterburn/Aftershock', 'tt7116248', '487284', 1, '?', 'Hollywood', '2017', 'Businesswoman Gia Rossi is determined to be successful in her new job, but when her ex lover Jax Rutledge waltzes back into her life, their passionate connection ignites not only in the boardroom, but the bedroom.', 'Romance', 'Drama', '', 'L5hrRVyfjaw', '/tj6VwGIeuPXP2PWNFSSZqcBXe4U.jpg', 1, ' ', '/2uPgZW9cgDMFoE7WYlpUO73QXm2.jpg', '/2uPgZW9cgDMFoE7WYlpUO73QXm2.jpg', '100', 6.271),
(1573, 1, 'Every Day', 'tt7026672', '465136', 1, 'PG-13', 'Hollywood', '2018', '16-year old Rhiannon falls in love with a mysterious spirit named “A” that inhabits a different body every day. Feeling an unmatched connection, Rhiannon and “A” work each day to find each other, not knowing what the next day will bring.', 'Romance', 'Fantasy', '', 'OqVqBG6z1yQ', '/4UnME3icxSspwL0UoGZNSyyp7Xs.jpg', 1, ' ', '/oDtQTCIGkdAv04X0IHNQ7t6ruuJ.jpg', '/hcoeD3oLP7t2dwMK7mnRAUkUxWS.jpg', '97', 7.236),
(1574, 1, 'American Fiction', 'tt23561236', '1056360', 1, '?', 'Hollywood', '2023', 'Thelonious “Monk” Ellison\'s writing career has stalled because his work isn’t deemed “Black enough.” Monk, a writer and English professor, writes a satirical novel under a pseudonym, aiming to expose the publishing world\'s hypocrisies. The book’s immediate success forces him to get deeper enmeshed in his assumed identity and challenges his closely-held worldviews.', 'Comedy', 'Drama', '', 'o23qoQZF6mc', '/htPScB9pEDmYOT0eCW6kahgv77t.jpg', 1, ' ', '/1AT4Nc6oHkmL3p6i27P14SBnIpb.jpg', '/1AT4Nc6oHkmL3p6i27P14SBnIpb.jpg', '117', 7.8),
(1575, 1, 'Fear Street: 1994', 'tt6566576', '591273', 1, 'R', 'Hollywood', '2021', 'After a series of brutal slayings, a teen and her friends take on an evil force that\'s plagued their notorious town for centuries.', 'Mystery', 'Horror', '', '9YZWd4S7fjI', '/9J9Wy39ZjrVmfk7yMkulpcI5sy0.jpg', 1, ' ', '/cBRrYjxB4dHVTR9mILg9KJXVnkE.jpg', '/vu5Y8qFqlzcboDbbZIMTAgj0KLb.jpg', '107', 6.716);
INSERT INTO `seasons` (`idSeason`, `idSeries`, `numberSeason`, `trailerSeason`, `synopsisSeason`, `ongoingSeason`) VALUES
(42, 29, '1', 'Yj0l7iGKh8g', 'Barry Allen was 11 years old when his mother was killed in a bizarre and terrifying incident and his father was falsely convicted of the murder. With his life changed forever by the tragedy, Barry was taken in and raised by Detective Joe West, the father of Barry\'s best friend, Iris.', 1),
(43, 30, '6', 'nulll', 'Season 6 of Rick and Morty', 0),
(44, 31, '1', 'gcTkNV5Vg1E', 'Nine noble families wage war against each other in order to gain control over the mythical land of Westeros. Meanwhile, a force is rising after millenniums and threatens the existence of living men.', 1),
(46, 32, '1', 'gjnjyCwbawI', 'Cantankerous Robert \"Granddad\" Freeman is the legal guardian of his grandsons, 10-year-old revolutionary Huey and 8-year-old Riley, a product of contemporary rap culture.', 1),
(47, 33, '1', 'BsNRPkOV_Mo', 'Choi Joon Woong looks for a job, but it is hard for him to get hired. Except for that, he seems like a perfect guy. He graduated from a prestigious university and he has wealthy parents. One night, he accidentally meets angels of death Gu Ryeon and Im Ryoog Gu. The two death angels belong to a crisis management team. Gu Ryeon is the leader and Im Ryoog Gu is a member. Their objective is to save suicidal people. Soon, Choi Joon Woong becomes a new member of the crisis management team.', 1),
(48, 32, '2', 'FTMHx6JuQDw', 'The Second Season of the Adult Cartoon Series \"The Boondocks\"', 1),
(49, 34, '1', '5SKP1_F7ReE', 'The series follows the eponymous Boys (led by Billy Butcher), a group of vigilantes looking to bring down Vought International and expose its corrupt superheroes. When his girlfriend is accidentally killed by A-Train, Hughie Campbell joins the Boys to get revenge against the Seven.', 1),
(50, 35, '1', 'aH1FOkJys3Y', 'As Jimmy Keene begins a 10-year prison sentence, he gets an incredible offer: If he can elicit a confession from suspected killer Larry Hall, Jimmy will be freed. Completing this mission becomes the challenge of a lifetime.', 1),
(52, 37, '1', 'Q_4YpdGbkkA', 'The intricate and magical love story of Clare and Henry, and a marriage with a problemâ€¦ time travel.', 1),
(53, 38, '1', 'lnY9FWUTY84', 'The series follows Shaun Murphy, a young autistic surgeon with savant syndrome from the small city of Casper, Wyoming. He relocates to San Jose, California, to work at the prestigious San Jose St. Bonaventure Hospital. The question will arise: can a person who doesnâ€™t have the ability to relate to people actually save their lives.', 1),
(54, 39, '1', 'lY55ig5js6I', 'A dangerously charming, intensely obsessive young man goes to extreme measures to insert himself into the lives of those he is transfixed by.', 1),
(55, 39, '2', 'xXBTImqyeU0', 'A dangerously charming, intensely obsessive young man goes to extreme measures to insert himself into the lives of those he is transfixed by', 1),
(56, 36, '1', '83ClbRPRDXU', 'After years of imprisonment, Morpheus â€” the King of Dreams â€” embarks on a journey across worlds to find what was stolen from him and restore his power.', 1),
(57, 41, '1', 'E7pZvihpgyA', 'The Legend of Korra, also known as Avatar: The Legend of Korra, is an American anime-influenced animated television series created by Michael Dante DiMartino and Bryan Konietzko for Nickelodeon.', 1),
(58, 43, '1', 'alzrway8jPM', 'Follow the adventures of Po, who partners up with a no-nonsense English knight named Wandering Blade to find a collection of four powerful weapons before a mysterious pair of weasels do, and save the world from destruction.', 1),
(59, 42, '2', 'ba8lGRIn5P0', 'A family of aliens move to middle America, where they debate whether life is better there or on their home planet.', 1),
(60, 44, '1', 'TWnmI3lGGhs', 'Hanna is an extraordinary girl who has been raised in the forest, evading the relentless pursuit of an off-the-book CIA agent. This series -- part high-concept thriller, part coming-of-age drama -- follows the girl on her journey as she tries to unearth the truth behind who she is. \"Hanna\" is based on the 2011 film of the same name that starred Oscar-nominated actress Saoirse Ronan in the title role.', 1),
(61, 38, '3', '3om3dY_50nQ', 'The series follows Shaun Murphy, a young autistic surgeon with savant syndrome from the small city of Casper, Wyoming. He relocates to San Jose, California, to work at the prestigious San Jose St. Bonaventure Hospital. The question will arise: can a person who doesnâ€™t have the ability to relate to people actually save their lives.', 1),
(62, 38, '4', 'hfyYVWlr7QI', 'The series follows Shaun Murphy, a young autistic surgeon with savant syndrome from the small city of Casper, Wyoming. He relocates to San Jose, California, to work at the prestigious San Jose St. Bonaventure Hospital. The question will arise: can a person who doesnâ€™t have the ability to relate to people actually save their lives.', 1),
(63, 42, '3', 'kH9TdPmnfZ0', 'In this season our mischievous aliens kick-start some rather banal hobbies, have fun with their ray guns, journey to Hululand', 1),
(64, 45, '1', 'X4QYV5GTz7c', 'Based on the award-winning novels by Isaac Asimov, \"Foundation\" chronicles a band of exiles on their monumental journey to save humanity and rebuild civilization amid the fall of the Galactic Empire.', 1),
(65, 46, '1', 'u7JsKhI2An0', 'In She-Hulk: Attorney at Law, Jennifer Walters (Tatiana Maslany)â€”an attorney specializing in superhuman-oriented legal casesâ€”must navigate the complicated life of a single, 30-something who also happens to be a green 6-foot-7-inch superpowered hulk.', 0),
(66, 47, '1', 'D7eFpRf4tac', 'A series of shorts featuring the seedling Groot along with several new and unusual characters', 1),
(67, 48, '1', 'f2oHMze7RwY', 'A family man struggles to gain a sense of cultural identity while raising his kids in a predominantly white, upper-middle-class neighborhood.', 1),
(68, 49, '1', 'SQ92hXK2w3M', 'Halo follows an epic 26th-century conflict between humanity and an alien threat known as the Covenant. Halo will weave deeply drawn personal stories with action, adventure and a richly imagined vision of the future.', 1),
(69, 50, '1', 'oBNH-PY730k', 'Chucky is an American horror television series created by Don Mancini and based on the Child\'s Play film franchise.', 1),
(70, 51, '1', 'Xcbc7horP3A', 'The world is divided into four nations -- the Water Tribe, the Earth Kingdom, the Fire Nation and and the Air Nomads -- each represented by a natural element for which the nation is named. Benders have the ability to control and manipulate the element from their nation. Only the Avatar is the master of all four elements. The ruthless Fire Nation wants to conquer the world but the only bender who has enough power, the Avatar, has disappeared ... until now. His tribe soon discovers that Aang is the long-lost Avatar. Now Katara and Sokka must safeguard Aang on his journey to master all four elements and save the world from the Fire Nation.', 1),
(71, 52, '1', 'ZQiCxWmO5BU', 'A quarter-life crisis causes a young Chinese American woman, Nicky Shen, to drop out of college and go on a life-changing journey to an isolated monastery in China. But when she returns to San Francisco, she finds her hometown is overrun with crime and corruption and her own parents Jin and Mei- Li are at the mercy of a powerful Triad. Nicky will rely on her tech-savvy sister Althea and Altheaâ€™s fiancÃ© Dennis, pre-med brother Ryan, Assistant District Attorney and ex-boyfriend Evan, and new love interest Henry as well as her martial arts skills and Shaolin values to protect her community and bring criminals to justiceâ€¦ All while searching for the ruthless assassin who killed her Shaolin mentor Pei-Ling and is now targeting her.', 1),
(72, 41, '2', 'LK8BJmc908c', 'Korra\'s uncle Unalaq, chief of the Northern Water Tribe, seizes power in the southern tribe. While Korra\'s friends seek support against Unalaq, Korra learns of the first Avatar, Wan, who fused his soul with the spirit of light, Raava, to imprison Vaatu, the spirit of darkness. Unalaq frees Vaatu during the Harmonic Convergence, a decamillennial alignment of planets, and unites with him to become a dark Avatar. After defeating Unalaq, Korra chooses to leave open the portals between the material world and the spirit world, allowing a new coexistence of spirits and humans.', 1),
(73, 53, '1', 'qIkEmW1PkYE', 'Synopsis A thrilling and raw crime drama following a gang of drug dealers in Hackney, London â€“ an honest and gripping rendition of inner-city drug and gang culture.', 1),
(74, 54, '1', 'x7Krla_UxRg', 'A former U.S. Marine, struggling with dissociative identity disorder, is granted the powers of an Egyptian moon god. But he soon finds out that these newfound powers can be both a blessing and a curse to his troubled life.', 1),
(75, 55, '1', 'nW948Va-l10', 'The mercurial villain Loki resumes his role as the God of Mischief in a new series that takes place after the events of â€œAvengers: Endgame.â€', 1),
(76, 58, '1', '5VYb3B1ETlk', 'Former Avenger Clint Barton has a seemingly simple mission: get back to his family for Christmas.', 1),
(77, 59, '1', 'sj9J2ecsSpo', 'Wanda\'s pregnancy fritzes her powers as she and Vision prepare for an accelerated delivery.', 1),
(78, 57, '1', 'x9D0uUKJ5KI', 'The First Season of What If...? by Marvel Studios.', 1),
(79, 60, '1', '4Ps6nV4wiCE', 'In the cities of Piltover and Zaun, tensions rise as inventors, hooligans, politicians and crime lords grow increasingly fed up with the constraints of a devastated society. With the situation on the verge of being unsustainable, two sisters steal an artifact of immeasurable power.', 0),
(80, 61, '1', '-bfAVpuko5o', 'Invincible revolves around Mark Grayson aka Invincible who struggles with his powers and his relationships, and coping with both of them simultaneously.', 1),
(81, 38, '5', 'BIyqelfQFAo', 'The series follows Shaun Murphy, a young autistic surgeon with savant syndrome from the small city of Casper, Wyoming. He relocates to San Jose, California, to work at the prestigious San Jose St. Bonaventure Hospital. The question will arise: can a person who doesnâ€™t have the ability to relate to people actually save their lives.', 1),
(82, 62, '1', 'gb72HBB1QbA', 'A vengeful Japanese snow monkey and the ghost of an American assassin cut down Tokyo\'s underworld.', 1),
(83, 63, '1', 'RPOT1CHyCp4', 'Five young heroesâ€”Robin, Kid Flash, Aqualad, Superboy and Miss Martianâ€”form a covert ops team to undertake covert operations on behalf of the Justice League.', 1),
(84, 64, '1', '7rcozIVtujw', 'Vikings transports us to the brutal and mysterious world of Ragnar Lothbrok, a Viking warrior and farmer who yearns to explore â€“ and raid â€“ the distant shores across the ocean.', 1),
(85, 34, '2', 'MN8fFM1ZdWo', 'Butcher arranges a deal with Colonel Grace Mallory to capture the superpowered terrorist in exchange for Mallory finding Becca\'s location. The Boys later learn the terrorist is Kimiko\'s younger brother, Kenji, whom they manage to subdue. A-Train threatens to expose Annie\'s involvement with the Boys when he awakens from his coma, but Annie counters with the knowledge that he murdered Popclaw', 1),
(86, 65, '1', 'LpmMxXfBn-Y', 'A psychotherapist who recently lost his wife, finds himself held prisoner by a serial killer with an unusual request to curb his homicidal urges.', 0),
(87, 66, '1', '9JAQh544RHE', 'Chronicles the illegitimate son of Zeus, a young man tasked with saving heaven and earth despite the interference of a vengeful goddess and her monstrous forces.', 1),
(88, 67, '1', 'V3RkBKedKWw', 'The support crew serving on one of Starfleetâ€™s least important ships, the U.S.S. Cerritos, have to keep up with their duties, often while the ship is being rocked by a multitude of sci-fi anomalies.', 1),
(89, 68, '1', 'dld3WPwV1wE', 'A collection of animated short stories that takes place inside The Boys universe.', 1),
