(772, 421, '5', '3JPNVHRNCrY', 'A comedy-drama following a chaste young woman who is accidentally impregnated via artificial insemination as she struggles to inform her devoutly religious family and make the right choices concerning the child. Based on the telenovela \"Juana la virgen.\"', 1),
(773, 424, '4', '3nvw0TA_CeY', 'Explore an aspirational world where NASA and the space program remained a priority and a focal point of our hopes and dreams as told through the lives of NASA astronauts, engineers, and their families.', 0),
(774, 425, '1', 'MRkInIXz2Fk', 'Through a scholarship to a top school, Ishaya ends up in the luxurious world of the happy few in Nigeria, but a secret threatens not only to put an end to this.', 1),
(775, 426, '1', 'PhOR6DIS_Ho', 'Everyone has secrets and Olivia Pope has dedicated her life to protecting and defending the public images of the elite by keeping those secrets under wraps. Pope and her team are at the top of their game when it comes to getting the job done for their clients, but it becomes apparent that these \"gladiators in suits,\" who specialize in fixing the lives of other people, have trouble fixing those closest at hand -- their own.', 1),
(776, 427, '1', 'NdnPL6YgN7w', 'Ruthless siblings Roderick and Madeline Usher have built Fortunato Pharmaceuticals into an empire of wealth, privilege and power. But past secrets come to light when the heirs to the Usher dynasty start dying at the hands of a mysterious woman from their youth.', 1),
(777, 428, '1', '4WXDJPaHuR4', 'Torn from his homeland and the woman he loves, Spartacus is condemned to the brutal world of the arena where blood and death are primetime entertainment.', 1),
(778, 428, '2', '4WXDJPaHuR4', 'Torn from his homeland and the woman he loves, Spartacus is condemned to the brutal world of the arena where blood and death are primetime entertainment.', 1),
(779, 428, '3', '4WXDJPaHuR4', 'Torn from his homeland and the woman he loves, Spartacus is condemned to the brutal world of the arena where blood and death are primetime entertainment.', 1),
(780, 429, '1', 'rFYNqmKdaoI', 'Three women living in three different decades: a housewife in the \'60s, a socialite in the \'80s and a lawyer in 2018, deal with infidelity in their marriages.', 1),
(781, 429, '2', 'byX3zWiotxg', 'Three women living in three different decades: a housewife in the \'60s, a socialite in the \'80s and a lawyer in 2018, deal with infidelity in their marriages.', 1),
(782, 430, '1', 'FaDFty5ipEg', 'A group of fun-loving American girls burst onto the scene in tightly corseted 1870s London, kicking off an Anglo-American culture clash. Sent to secure husbands and status, the buccaneers\' hearts are set on much more than that.', 0),
(783, 431, '1', 'cccG9NNXCew', 'In any given year, more than 600,000 people are reported missing in the U.S. Of these reported cases, more than half of the missing people are people of color, too easily neglected by the system. Gabi Mosely, a former missing person herself, now specializes in PR and leads a crisis management team that seeks out these missing people. But unbeknownst to anyone, Mosely is hiding a dark secret of her own.', 0),
(784, 272, '3', 'HLVg_D1cznE', 'This quick-witted spy drama follows a dysfunctional team of MI5 agents—and their obnoxious boss, the notorious Jackson Lamb—as they navigate the espionage world’s smoke and mirrors to defend England from sinister forces.', 0),
(785, 432, '1', 'eWV-j_9FAw4', 'The mysterious disappearance of a Scottish fishing trawler and a death on-board the submarine HMS Vigil bring the police into conflict with the Navy and British security services. DCI Amy Silva and DS Kirsten Longacre lead an investigation on land and at sea into a conspiracy that goes to the very heart of Britain’s national security.', 0),
(786, 432, '2', 'gZ9RiLyak1o', 'The mysterious disappearance of a Scottish fishing trawler and a death on-board the submarine HMS Vigil bring the police into conflict with the Navy and British security services. DCI Amy Silva and DS Kirsten Longacre lead an investigation on land and at sea into a conspiracy that goes to the very heart of Britain’s national security.', 0),
(787, 433, '1', 'KZ8J4f63rkg', 'A road rage incident between two strangers — a failing contractor and an unfulfilled entrepreneur — sparks a feud that brings out their darkest impulses.', 1),
(788, 434, '1', '3k0-7Lhvj1Y', 'Iris dreams of being an artist. Silas is a taxidermist who longs to be revered. Louis is a painter searching for his next muse. As their lives collide a love triangle appears to bloom. But this will morph into a story of dark obsession.', 0),
(789, 435, '1', 'UjGSexWcEPg', 'Decades-long chronicle of the risky, volatile and steamy relationship between the charismatic and ambitious Hawk and the pious and idealistic Tim, two political staffers who fall in love at the height of the 1950s Lavender Scare. Through the Vietnam War protests of the 1960s, the drug-fueled disco culture of the 1970s and the AIDS crisis of the 1980s, the two men’s fiery affair only intensifies despite the constant threat of being exposed and losing everything.', 0),
(790, 436, '1', 'zQFJS4lcMKo', 'When retired Military Police Officer Jack Reacher is arrested for a murder he did not commit, he finds himself in the middle of a deadly conspiracy full of dirty cops, shady businessmen and scheming politicians.', 1),
(791, 437, '1', '4hNc0cnp38k', 'Candy and Pat Montgomery and Betty and Allan Gore — two churchgoing couples — enjoy their small town Texas life… until an extramarital affair leads somebody to pick up an axe.', 1),
(792, 436, '2', 'x5ng55vaKeI', 'When retired Military Police Officer Jack Reacher is arrested for a murder he did not commit, he finds himself in the middle of a deadly conspiracy full of dirty cops, shady businessmen and scheming politicians.', 0),
(793, 223, '2', 'jhwQrYVwt94', 'Two estranged high school friends from Miami reunite to form a rap group.', 0),
(794, 438, '1', '0ZfZj2bn_xg', 'In 2033, people who are near death can be “uploaded” into virtual reality hotels run by 6 tech firms. Cash-strapped Nora lives in Brooklyn and works customer service for the luxurious “Lakeview” digital afterlife. When L.A. party-boy/coder Nathan’s self-driving car crashes, his high-maintenance girlfriend uploads him permanently into Nora’s VR world.', 0),
(795, 438, '3', '7dr2pEYI_R4', 'In 2033, people who are near death can be “uploaded” into virtual reality hotels run by 6 tech firms. Cash-strapped Nora lives in Brooklyn and works customer service for the luxurious “Lakeview” digital afterlife. When L.A. party-boy/coder Nathan’s self-driving car crashes, his high-maintenance girlfriend uploads him permanently into Nora’s VR world.', 0),
(796, 439, '1', 'tV6V7-HRQ4Y', 'This nightmarish anthology series, under the creative guidance of master of horror Eli Roth, showcases classic urban legends as you\'ve never seen them before. Featuring lurking psychopaths, murderous mysteries, creepy creatures and twisting tales, these disturbing legends prey on our most deeply embedded fears to shock and terrify.', 0),
