(830, 444, '1', 'TJ-q3_b3dkI', 'The story of Elizabeth of York, the White Queen\'s daughter, and her marriage to the Lancaster victor, Henry VII. Based on the Philippa Gregory book of the same name.', 1),
(831, 445, '1', 'aDrsItJ_HU4', '100 years in the future, when the Earth has been abandoned due to radioactivity, the last surviving humans live on an ark orbiting the planet — but the ark won\'t last forever. So the repressive regime picks 100 expendable juvenile delinquents to send down to Earth to see if the planet is still habitable.', 1),
(832, 446, '1', 'b3XtkXvPbsE', 'This limited series chronicles the incredible true story of Madam C.J. Walker, who was the first African American self-made millionaire.', 1),
(833, 447, '1', 's2TyVQGoCYo', 'Six young people from New York City, on their own and struggling to survive in the real world, find the companionship, comfort and support they get from each other to be the perfect antidote to the pressures of life.', 1),
