(848, 449, '1', '9nYzLcwO8rI', 'Percy Jackson is on a dangerous quest. Outrunning monsters and outwitting gods, he must journey across America to return Zeus\' master bolt and stop an all-out war. With the help of his quest mates Annabeth and Grover, Percy\'s journey will lead him closer to the answers he seeks: how to fit into a world where he feels out of place, and find out who he\'s destined to be.', 0),
